E_D("replace into `phome_ecms_game` values('1534','18','0','','','','1','admin','','1','0','1343228009','0','0','0','0','','','1534','0','0','0','0','0','0','双面黑角大魔王','1343228009','/spic/20120725/2782.jpg','0','1','1343228009','0','3','1','0','','0','','/d/file/swf/0128.swf','667','479','','1','','0','','1','/dpic/20120725/2783.jpg','11122','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRWswVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0128.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0128.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0128.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1535','18','0','','','','1','admin','','1','0','1343228009','0','0','0','0','','','1535','0','0','0','0','0','0','有趣的家庭','1343228009','/spic/20120725/2800.jpg','0','1','1343228009','0','3','1','0','','0','','/d/file/swf/0119.swf','667','479','我家有爸爸。妈妈、哥哥、还有我。我的哥哥叫冯建动，我很喜欢他，因为他常常跟我玩。我也喜欢我的爸爸和妈妈。','1','','0','','1','/dpic/20120725/2801.jpg','11050','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRVUxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0119.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0119.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0119.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1536','18','0','','','','1','admin','','1','0','1343228010','0','0','0','0','','','1536','0','0','0','0','0','0','鸭妈妈找蛋','1343228010','/spic/20120725/2830.jpg','0','1','1343228010','0','3','1','0','','0','','/d/file/swf/0110.swf','667','479',' 鸭妈妈，生鸭蛋，那鸭蛋像姑娘的脸蛋，谁见了都说：“啊，多么可爱的鸭蛋！”鸭妈妈听了，乐得呷呷呷地叫：“嗯，这是我生的蛋啊！” <br />    可是，鸭妈妈有个毛病：不在窝里生蛋，她走到哪里，要生蛋了，就生在哪里，所以她常常找不到自己生的蛋。','1','','0','','1','/dpic/20120725/2831.jpg','11040','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRVYzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0110.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0110.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0110.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1537','18','0','','','','1','admin','','1','0','1343228010','0','0','0','0','','','1537','0','0','0','0','0','0','医生吏怀哲','1343228010','/spic/20120725/2806.jpg','0','1','1343228010','0','3','1','0','','0','','/d/file/swf/0118.swf','667','479','依旧以三年，以为年轻的德国医生和他的妻子一起来到非洲非常荒僻的森林要给人看病。他在哪里为保障非洲工人的健康而辛勤工作，度过了五十多年的岁月，他就是被称为【森林医生】的吏怀哲。','1','','0','','1','/dpic/20120725/2807.jpg','11049','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRVUwVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0118.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0118.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0118.jpg','0','三个月以上','0','','0','','0','0','0');");
