E_D("replace into `phome_ecms_game` values('1539','18','0','','','','1','admin','','1','0','1343228011','0','0','0','0','','','1539','0','0','0','0','0','0','许愿井','1343228011','/spic/20120725/2836.jpg','0','1','1343228011','0','3','1','0','','0','','/d/file/swf/0109.swf','667','479','村子里有一口许愿井，它是一口既聪明又有点邪恶的井。这天，当渴望拥有一个朋友的十一岁女孩纽丽为凯蒂许下一个愿后，可怕的事情发生了：坐在轮椅上的凯蒂变成了纽丽，而纽丽变成了坐在轮椅上无法行走的凯蒂...... ','1','','0','','1','/dpic/20120725/2837.jpg','11039','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRUUxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0109.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0109.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0109.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1540','18','0','','','','1','admin','','1','0','1343228011','0','0','0','0','','','1540','0','0','0','0','0','0','一片树叶','1343228011','/spic/20120725/2812.jpg','0','1','1343228011','0','3','1','0','','0','','/d/file/swf/0117.swf','667','479','一片树叶静静的躺在地上，一阵风卷起了树叶，大猩猩正在想把树叶撕掉，风儿又卷起了树叶。','1','','0','','1','/dpic/20120725/2813.jpg','11048','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRVV6VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0117.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0117.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0117.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1541','18','0','','','','1','admin','','1','0','1343228011','0','0','0','0','','','1541','0','0','0','0','0','0','嘟嘟生病了','1343228011','/spic/20120725/2754.jpg','0','1','1343228011','0','3','1','0','','0','','/d/file/swf/0126.swf','667','479','一天，嘟嘟感冒了，躺在床上又流鼻涕又流泪，还”哼哼“的叫哥不停。小松鼠来找嘟嘟玩，”啊，家里怎么这么乱？嘟嘟，你生病了？“小松鼠好难过，就帮它把屋子收拾得干干净净了。','1','','0','','1','/dpic/20120725/2755.jpg','11057','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRWt5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0126.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0126.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0126.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1542','18','0','','','','1','admin','','1','0','1343228012','0','0','0','0','','','1542','0','0','0','0','0','0','星期七瀑布','1343228012','/spic/20120725/2842.jpg','0','1','1343228012','0','3','1','0','','0','','/d/file/swf/0108.swf','667','479','下雨了，雨珠汇成了一条小溪，小溪跳下山崖，跳到了一间小木房上，在房顶上跳舞。“叮咚，叮咚”，“嘀嗒，嘀嗒......”什么在响呀，小猴子一看，呀，小溪在我的房子上跳舞，我房子漏了，雨水打湿了墙壁，流到了地上，拖鞋变成了小船儿，小猴子赶紧冲出门去找来了几块长长的竹板，叮叮咚咚，在房子上边架起来一层竹板，小溪沿着竹板跳呀跳呀，跳得很高兴。','1','','0','','1','/dpic/20120725/2843.jpg','11038','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRUUwVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0108.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0108.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0108.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1543','18','0','','','','1','admin','','1','0','1343228012','0','0','0','0','','','1543','0','0','0','0','0','0','一块奶酪','1343228012','/spic/20120725/2778.jpg','0','1','1343228012','0','3','1','0','','0','','/d/file/swf/0116.swf','667','479','一天，一个小姑娘的手帕掉到了河里，就坐在河边哭了起来。一只小乌鸦看见了，就帮小姑娘捡了回来。','1','','0','','1','/dpic/20120725/2779.jpg','11047','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRVV5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0116.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0116.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0116.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1544','18','0','','','','1','admin','','1','0','1343228013','0','0','0','0','','','1544','0','0','0','0','0','0','坐轮椅的兔兔','1343228013','/spic/20120725/2762.jpg','0','1','1343228013','0','3','1','0','','0','','/d/file/swf/0125.swf','667','479',' 兔兔的腿不小心摔断了，猫医生给他装上轮椅。 兔兔住在山上，他摇着轮椅下山去玩。“呼呼，呼呼”，轮椅跑得飞快。停下，停下，兔兔来到小猴的家门前面，“小猴，小猴，你在哪里？我想跟你一起去玩。”小猴在屋后面摘桃子，他把头伸出来一看，“嘿！来了，来了，我陪你一块玩！”小猴站在兔兔的轮椅上，他们一块摇着轮椅下山。“呼呼，呼呼”，轮椅跑得飞快。','1','','0','','1','/dpic/20120725/2763.jpg','11056','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRWt4VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0125.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0125.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0125.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1545','18','0','','','','1','admin','','1','0','1343228013','0','0','0','0','','','1545','0','0','0','0','0','0','小鼹鼠找快乐','1343228013','/spic/20120725/2792.jpg','0','1','1343228013','0','3','1','0','','0','','/d/file/swf/0107.swf','667','479','一直以来，我认为快乐是需要自己去发现，去寻找的。抱有一个知足常乐的心态，你就会发现，其实幸福就在你身边。','1','','0','','1','/dpic/20120725/2793.jpg','11037','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRUV6VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0107.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0107.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0107.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1546','18','0','','','','1','admin','|30|','1','0','1343228182','0','0','0','0','','','1546','0','0','0','0','0','0','三个伙伴','1343228182','/spic/20120725/2928.jpg','0','1','1343228182','0','3','1','0','','0','','/d/file/swf/055.swf','667','479','“哗啦啦，哗啦啦……”春天的雨水就是多，刚才还是好好的天，一会就下起了大雨。不一会儿，雨停了，太阳又在蓝蓝的天上露出了笑脸。<br />小兔提着篮子蹦蹦跳跳的向小树林走去，他想采蘑菇。小兔刚走到竹园，听见“咕噜噜”的声音，一块大石头滚下来挡在小路上。小兔想，这块大石头挡路，我来把它搬走。<br />','1','','0','','1','/dpic/20120725/2929.jpg','10984','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9WRlYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/055.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/055.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/055.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1547','18','0','','','','1','admin','','1','0','1343228228','0','0','0','0','','','1547','0','0','0','0','0','0','水娃娃回家','1343228228','/spic/20120725/2906.jpg','0','1','1343228228','0','3','1','0','','0','','/d/file/swf/064.swf','667','479','旁白：金色的太阳照着雪山，一个可爱的水娃娃从山上跳下来，往山下跑去，跑进一条欢快的小溪。小溪：你好呀，水娃娃！水娃娃：你好呀，小溪！小鹿：我是小鹿，我可喜欢在水里洗澡啦！水娃娃呀水娃娃，我给你红花，我给你绿草，你留下来吧。水娃娃：谢谢你，可是我想念我的大海妈妈。旁白：水娃娃继续往前跑，跑进一条宁静的河流。河流：你好呀，水娃娃！水娃娃：你好呀，河流！','1','','0','','1','/dpic/20120725/2907.jpg','10994','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9hbEYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/064.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/064.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/064.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1548','18','0','','','','1','admin','','1','0','1343228233','0','0','0','0','','','1548','0','0','0','0','0','0','面包里的小猫咪','1343228233','/spic/20120725/2942.jpg','0','1','1343228233','0','3','1','0','','0','','/d/file/swf/045.swf','667','479','一天中午小貓回家貓妈妈倒好了一盆水叫小貓咪洗澡小貓说：“不！我不洗！”<br />小貓又出去玩，它玩了一身的泥巴，变成了一只小黑猫。<br />小貓玩累了，它躺在地上休息；忽然，三只小老鼠看见了小猫，以为是一个大面包，忍不住直流口水，老鼠说：“我们把它抬到洞里，说不定能吃上三天三夜呢！”三只老鼠忍不住吃了几口把小猫身上的泥壳咬掉了。一只老鼠踩了小猫一脚，小猫痛得“喵！喵！”直叫，三只老鼠吓得乱跑。','1','','0','','1','/dpic/20120725/2944.jpg','10974','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9SRlYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/045.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/045.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/045.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1549','18','0','','','','1','admin','','1','0','1343228238','0','0','0','0','','','1549','0','0','0','0','0','0','人参娃娃','1343228238','/spic/20120725/2934.jpg','0','1','1343228238','0','3','1','0','','0','','/d/file/swf/054.swf','667','479','这部动画片很有中国特色，故事内容很传统，借助人参娃娃惩罚财主胡刮皮的小故事。人物造型是中国最传统的剪纸，别的人物造型也同样别具特色，加上故事的出奇效果，带给我们紧张气氛的同时也感到风趣幽默的感觉。','1','','0','','1','/dpic/20120725/2935.jpg','10983','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9WRkYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/054.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/054.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/054.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1550','18','0','','','','1','admin','','1','0','1343228239','0','0','0','0','','','1550','0','0','0','0','0','0','水孩子','1343228239','/spic/20120725/2912.jpg','0','1','1343228239','0','3','1','0','','0','','/d/file/swf/063.swf','667','479','汤姆在随老板旅行时，仙女给了他一个启示：“那些希望干净的人，他们会干净的；而那些希望肮脏的人，他们就会肮脏。”这是故事中最经典的一个警句。　　当汤姆受到召唤变成水孩子后，他经历了一系列的奇遇，后来到一个仙岛上接受教育。那里有个“自作自受”夫人，视孩子们的表现好坏给予奖惩；还有个“以己所欲施之于人”夫人，她给予孩子们至善的仁爱。在她们和她们指派的艾莉的帮助下，汤姆渐渐成长起来。','1','','0','','1','/dpic/20120725/2913.jpg','10993','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9hazExWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/063.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/063.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/063.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1551','18','0','','','','1','admin','','1','0','1343228240','0','0','0','0','','','1551','0','0','0','0','0','0','没耐性的叮叮','1343228240','/spic/20120725/2950.jpg','0','1','1343228240','0','3','1','0','','0','','/d/file/swf/044.swf','667','479','小白兔叮叮非常没有耐性，别人的话还没说完，他就摆摆长耳朵，不耐放的说：“懂了，懂了。”<br />叮叮的妈妈常常教导他：“叮叮，人家说话你只听半句这是不对的...”<br />妈妈还没说完，叮叮又淘气的抛开了：“懂了，懂了，您这是第一百零一次提醒我了。”<br />有一次，森林学校举办......','1','','0','','1','/dpic/20120725/2951.jpg','10973','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9SRkYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/044.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/044.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/044.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1552','18','0','','','','1','admin','','1','0','1343228252','0','0','0','0','','','1552','0','0','0','0','0','0','七色花','1343228252','/spic/20120725/2940.jpg','0','1','1343228252','0','3','1','0','','0','','/d/file/swf/qisehua.swf','667','479','传说中有一朵花是七色的花瓣，每一片花瓣都能赐予你神奇的力量，有个小女孩寻遍天涯要找它。<br />。。。这是小时候我最喜欢《花仙子》。<br />那时觉得好浪漫。---到哪里都要找到它！每天都听到这句歌词。<br />没想到，长大后爱情也如同七色花一样的难找。','1','','0','','1','/dpic/20120725/2941.jpg','10982','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5HY0dNeVZtOWtWMFYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2006/qisehua.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/053.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/053.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1553','18','0','','','','1','admin','','1','0','1343228253','0','0','0','0','','','1553','0','0','0','0','0','0','谁住在皮球里','1343228253','/spic/20120725/2920.jpg','0','1','1343228253','0','3','1','0','','0','','/d/file/swf/062.swf','667','479','咚、咚、咚……”皮球一蹦一蹦往前跳。 <br />“轱辘辘辘……”皮球滚起来。<br />“嗵、嗵、嗵……”皮球一蹦老高老高，又飞起来了<br />是谁住在皮球里？<br />哦，皮球里住的是兔子吗？要不它怎么会像兔予那样一跳一跳呢？<br />哦，皮球里住的是轮子吗？、要不它怎么会像轮子那样“轱辘辘”地滚个不停呢？<br />哦，皮球里住的是喜鹊吗？要不它怎么会像喜鹊一样飞起来呢？','1','','0','','1','/dpic/20120725/2921.jpg','10992','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9ha2wxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/062.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/062.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/062.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1554','18','0','','','','1','admin','','1','0','1343228258','0','0','0','0','','','1554','0','0','0','0','0','0','猫妈妈的悔','1343228258','/spic/20120725/2956.jpg','0','1','1343228258','0','3','1','0','','0','','/d/file/swf/043.swf','667','479','故事讲的是有一位猫妈妈很慈祥，但却办了很马虎的事。“差不多“成了它的口头语。它还把这个坏毛病传给了它的孩子。     结果，猫妈妈一家都成了“差不多”。<br />猫妈妈让老大去买面饼，老大却买来糖豆，还说反正都是吃的，差不多。','1','','0','','1','/dpic/20120725/2957.jpg','10972','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9SRTExWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/043.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/043.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/043.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1555','18','0','','','','1','admin','','1','0','1343228266','0','0','0','0','','','1555','0','0','0','0','0','0','朋友','1343228266','/spic/20120725/2946.jpg','0','1','1343228266','0','3','1','0','','0','','/d/file/swf/052.swf','667','479','朋友之间要彼此关心、理解、帮助、“患难之中见真情”真正的朋友在你遇到困难的时候会帮助你！而有的朋友在你困难的时候却离你而去，这样的朋友是在利用你！一但你没有被利用的价值，他们就会离你而去！如果你一生中没有遇到过任何挫折，你就永远不会知道谁才是你真正的好朋友！有的朋友只说你的优点，不说你的缺点，我觉得这样的朋友就不好！要学会分析！辩解！你才可以得到真正的友谊！ ','1','','0','','1','/dpic/20120725/2947.jpg','10981','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9WRWwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/052.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/052.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/052.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1556','18','0','','','','1','admin','','1','0','1343228269','0','0','0','0','','','1556','0','0','0','0','0','0','树上的鞋子','1343228269','/spic/20120725/2926.jpg','0','1','1343228269','0','3','1','0','','0','','/d/file/swf/061.swf','667','479','又翻石头又掘土，我一共捉了三只蟋蟀。我很累 就躺在一棵老槐树下休息。我脱了鞋，让脚丫子也轻松轻松。在吱吱喳喳的鸟声中，我睡着了。我梦见我的蟋蟀很厉害，斗败了伙伴们的所有的蟋蟀，忽然，来了一只大公鸡，要吃我的蟋蟀，我一惊，被吓醒了。我听见小鸟尖细的叫声.','1','','0','','1','/dpic/20120725/2927.jpg','10991','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9ha1YxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/061.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/061.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/061.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1557','18','0','','','','1','admin','','1','0','1343228275','0','0','0','0','','','1557','0','0','0','0','0','0','猫和老鼠 1','1343228275','/spic/20120725/2962.jpg','0','1','1343228275','0','3','1','0','','0','','/d/file/swf/maohelaoshu.swf','667','479','汤姆是一只常见的家猫，它有一种强烈的欲望，总想抓住与它同居一室却难以抓住的老鼠杰瑞，它不断地努力驱赶这些讨厌的房客，但总是遭到失败。而实际上它在追逐中得到的乐趣远远超过了捉住老鼠，即使偶尔捉住了杰瑞，结果也不知究竟该怎么处置这只老鼠！','1','','0','','1','/dpic/20120725/2963.jpg','10971','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREl4YUdJeWFHeGlSMFoyWXpKb01VeHVUak5hWnowOQ==','0','0','http://s.61baobao.com/common/flash/2006/maohelaoshu.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/042.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/042.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1558','18','0','','','','1','admin','','1','0','1343228275','0','0','0','0','','','1558','0','0','0','0','0','0','胖熊吹气球','1343228275','/spic/20120725/2954.jpg','0','1','1343228275','0','3','1','0','','0','','/d/file/swf/051.swf','667','479','小胖熊拿来五只气球分给大家。胖熊说：“这是顶顶好玩的气球！”<br />火红色的给小狗，小狗不会吹气球，胖熊帮它吹，哇，红色的气球像团火。<br />黄色的给小猫，小猫不会吹气球，胖熊帮它吹，哇，黄色的气球像鸭梨。<br />绿色的给小兔，小兔不会吹气球，胖熊帮它吹，哇，绿色的气球像个大苹果。<br />紫色的给小猪，小猪偏要自己吹气球，吹呀吹呀，吹爆了。啪，紫色的气球变成了碎片片，小猪抹起了眼泪。<br />小熊拿出第五只气球，吹呀吹呀，吹大了，气球像蓝天一样美丽，小熊把蓝气球递给小猪，小猪笑了。<br />袋鼠阿姨走过来，把一束吹好的气球送给胖熊，夸它是个好孩子。','1','','0','','1','/dpic/20120725/2955.jpg','10980','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9WRVYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/051.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/051.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/051.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1559','18','0','','','','1','admin','','1','0','1343228282','0','0','0','0','','','1559','0','0','0','0','0','0','妈妈,买绿豆','1343228282','/spic/20120725/2974.jpg','0','1','1343228282','0','3','1','0','','0','','/d/file/swf/040.swf','667','479','从平凡家庭母子的亲密对话中，探寻最美好的亲情互动。藉由一袋绿豆，发现生活的乐趣与生命力量的自我展现。','1','','0','','1','/dpic/20120725/2975.jpg','10969','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9SRUYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/040.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/040.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/040.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1560','18','0','','','','1','admin','','1','0','1343228282','0','0','0','0','','','1560','0','0','0','0','0','0','回家','1343228282','/spic/20120725/2996.jpg','0','1','1343228282','0','3','1','0','','0','','/d/file/swf/030.swf','667','479','小鸭子在森林里迷路了。<br />天渐渐黑了，小鸭子很害怕，可是他闭紧嘴巴，不哭也不叫他要自己找到加，找到亲爱的爸爸妈妈。','1','','0','','1','/dpic/20120725/2997.jpg','10959','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5la0YxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/030.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/030.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/030.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1561','18','0','','','','1','admin','','1','0','1343228284','0','0','0','0','','','1561','0','0','0','0','0','0','妈妈是超人','1343228284','/spic/20120725/2968.jpg','0','1','1343228284','0','3','1','0','','0','','/d/file/swf/041.swf','667','479','妈妈每天都辛苦的上班，下班后做好吃的晚餐，晚上还会念故事给我听，妈妈是超人。','1','','0','','1','/dpic/20120725/2969.jpg','10970','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9SRVYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/041.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/041.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/041.jpg','0','三个月以上','0','','0','','0','0','0');");
