E_D("replace into `phome_ecms_game` values('1563','18','0','','','','1','admin','','1','0','1343228285','0','0','0','0','','','1563','0','0','0','0','0','0','露珠项链','1343228285','/spic/20120725/2982.jpg','0','1','1343228285','0','3','1','0','','0','','/d/file/swf/039.swf','667','479','在小虫里面，长得最丑的要算小蜘蛛了。　　蟋蟀、纺织娘，还有蚂蚱，她们都穿着漂亮的裙衫，特别瞧不起小蜘蛛，总说：\\\\\"黑不溜秋的，小蜘蛛最丑！\\\\\" 　　就连毛毛虫也瞧不起小蜘蛛，她说：\\\\\"我将来会变成花蝴蝶的，她小蜘蛛变什么呀？\\\\\" 　　小蜘蛛当然很难过，所以她总是不敢和她们一起玩，独自躲在角落里织网。　　\\\\\"我自己织网玩儿吧。\\\\\"小蜘蛛这样想。','1','','0','','1','/dpic/20120725/2983.jpg','10968','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5lbXQxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/039.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/039.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/039.jpg','0','三个月以上','0','','0','','0','0','0');");
