E_D("replace into `phome_ecms_game` values('1565','18','0','','','','1','admin','','1','0','1343228287','0','0','0','0','','','1565','0','0','0','0','0','0','画太阳','1343228287','/spic/20120725/3010.jpg','0','1','1343228287','0','3','1','0','','0','','/d/file/swf/028.swf','667','479','太阳和以太阳为中心并受其引力的支配而环绕它运动的天体系统叫太阳系。太阳系的成员包括太阳和环绕太阳的行星（如水星，金星，地球，火星，木星，土星，天王星，海王星等），2000多颗轨道已确定的小行星，数量不少的卫星以及为数很多的彗星与流星体等到。 ','1','','0','','1','/dpic/20120725/3011.jpg','10957','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5hbWQxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/028.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/028.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/028.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1566','18','0','','','','1','admin','','1','0','1343228287','0','0','0','0','','','1566','0','0','0','0','0','0','盖房子','1343228287','/spic/20120725/3028.jpg','0','1','1343228287','0','3','1','0','','0','','/d/file/swf/019.swf','667','479','猪妈妈有三个孩子，老大、老二和老三，一天猪妈妈说：“孩子们你们已经都长大了，每个人去盖一间房子，看谁的本领大！”老大用稻草很快就盖了一个漂亮的稻草房子！老二用木头盖了个房子。只有老三想好好建一个结结实实的砖房子。到了傍晚老三终于盖好了一个又结实又漂亮的砖房子。','1','','0','','1','/dpic/20120725/3029.jpg','10948','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WR3QxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/019.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/019.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/019.jpg','0','三个月以上','0','','0','','0','0','0');");
