E_D("replace into `phome_ecms_game` values('1568','18','0','','','','1','admin','','1','0','1343228288','0','0','0','0','','','1568','0','0','0','0','0','0','红色小绵羊','1343228288','/spic/20120725/2980.jpg','0','1','1343228288','0','3','1','0','','0','','/d/file/swf/027.swf','667','479','小绵羊在灌木林的空地上采了一捧鲜红的草莓，他把草莓拿到湖边洗着。','1','','0','','1','/dpic/20120725/2981.jpg','10956','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5hbU4xWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/027.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/027.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/027.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1569','18','0','','','','1','admin','','1','0','1343228289','0','0','0','0','','','1569','0','0','0','0','0','0','力士长的任务(上)','1343228289','/spic/20120725/2952.jpg','0','1','1343228289','0','3','1','0','','0','','/d/file/swf/037.swf','667','479','巨人村里有一个传说：村里曾经有个最强壮的巨人叫力士长，天神“洛”交给力士长一个艰巨的任务，完成这个任务要到地府，过火运河，上天塔，过森林……险关重重，力士长最终能不能顺利完成任务呢？','1','','0','','1','/dpic/20120725/2953.jpg','10966','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5lbU4xWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/037.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/037.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/037.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1570','18','0','','','','1','admin','','1','0','1343228289','0','0','0','0','','','1570','0','0','0','0','0','0','耳朵上的绿星 2','1343228289','/spic/20120725/3036.jpg','0','1','1343228289','0','3','1','0','','0','','/d/file/swf/018.swf','667','479','今天晚上，森林里要开个音乐会。小松鼠要到台上去表演唱歌。<br />小松鼠想：上台表演，一定要打扮得很美才行呀，我怎么打扮才好呢？<br />小松鼠来到了花园里，她看到了绿绿的小草。小松鼠想：我用小草编顶帽子，戴在头上一定很美。<br />小松鼠刚要去摘小草，小草说：“别摘我，别摘我，我要痛的呀！”<br />小松鼠没有摘小草，走开了。','1','','0','','1','/dpic/20120725/3037.jpg','10947','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WR2QxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/018.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/018.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/018.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1571','18','0','','','','1','admin','','1','0','1343228289','0','0','0','0','','','1571','0','0','0','0','0','0','红花和菊花','1343228289','/spic/20120725/2986.jpg','0','1','1343228289','0','3','1','0','','0','','/d/file/swf/026.swf','667','479','从前有一个农夫，他的名字叫阿飞，阿飞的弄场里有牛、羊、鸡、鸭、猫、狗、猪和马。他每天会和他的牛—小黄到田里u耕地。有一天阿飞在田里找到一朵红花，他便说：“我就把它放在花盆里”。','1','','0','','1','/dpic/20120725/2987.jpg','10955','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5hbGwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/026.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/026.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/026.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1572','18','0','','','','1','admin','','1','0','1343228290','0','0','0','0','','','1572','0','0','0','0','0','0','老虎的奶妈','1343228290','/spic/20120725/2958.jpg','0','1','1343228290','0','3','1','0','','0','','/d/file/swf/036.swf','667','479','小老虎刚生下来，妈妈就病倒了，可怜的小老虎没有奶吃，饿的哇哇哭。好心的猫妈妈跑过来给小虎喂奶，猫妈妈的奶水不够，狗妈妈又来给小胡喂奶。','1','','0','','1','/dpic/20120725/2959.jpg','10965','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5lbGwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/036.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/036.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/036.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1573','18','0','','','','1','admin','','1','0','1343228290','0','0','0','0','','','1573','0','0','0','0','0','0','红疙瘩吹眠曲','1343228290','/spic/20120725/2992.jpg','0','1','1343228290','0','3','1','0','','0','','/d/file/swf/025.swf','667','479','小猪有一把吉他，就来弹给朋友们听，朋友们很慷慨地当小猪的听众。<br />你能找出那一只是小猪吗？','1','','0','','1','/dpic/20120725/2993.jpg','10954','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5hbFYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/025.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/025.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/025.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1574','18','0','','','','1','admin','','1','0','1343228291','0','0','0','0','','','1574','0','0','0','0','0','0','耳朵上的绿星 1','1343228291','/spic/20120725/2994.jpg','0','1','1343228291','0','3','1','0','','0','','/d/file/swf/017.swf','667','479','今天晚上，森林里要开个音乐会。小松鼠要到台上去表演唱歌。<br />小松鼠想：上台表演，一定要打扮得很美才行呀，我怎么打扮才好呢？<br />小松鼠来到了花园里，她看到了绿绿的小草。小松鼠想：我用小草编顶帽子，戴在头上一定很美。<br />小松鼠刚要去摘小草，小草说：“别摘我，别摘我，我要痛的呀！”<br />小松鼠没有摘小草，走开了。','1','','0','','1','/dpic/20120725/2995.jpg','10946','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WR04xWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/017.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/017.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/017.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1575','18','0','','','','1','admin','','1','0','1343228291','0','0','0','0','','','1575','0','0','0','0','0','0','快乐幼儿园','1343228291','/spic/20120725/2964.jpg','0','1','1343228291','0','3','1','0','','0','','/d/file/swf/035.swf','667','479','早上，熊猫妈妈给熊猫宝宝穿上了一件新衣服，熊猫宝宝说：“哇，太漂亮了，我要穿上去幼儿园。”','1','','0','','1','/dpic/20120725/2965.jpg','10964','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5lbFYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/035.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/035.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/035.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1576','18','0','','','','1','admin','','1','0','1343228292','0','0','0','0','','','1576','0','0','0','0','0','0','和小朋友一起玩','1343228292','/spic/20120725/2998.jpg','0','1','1343228292','0','3','1','0','','0','','/d/file/swf/024.swf','667','479','有一天下午小猪看见小豆捧着一堆保龄球瓶，小豆说：“你看，这是罗兵送给我的保龄球耶，你要不要一起来玩呢？”<br />小猪和小豆很高兴的玩起了保龄球，可是他们却只能撞到一只瓶子......','1','','0','','1','/dpic/20120725/2999.jpg','10953','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5hbEYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/024.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/024.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/024.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1577','18','0','','','','1','admin','','1','0','1343228292','0','0','0','0','','','1577','0','0','0','0','0','0','豆豆兵去打仗','1343228292','/spic/20120725/3000.jpg','0','1','1343228292','0','3','1','0','','0','','/d/file/swf/016.swf','667','479','有一天，长豇豆国王给豆豆兵们下命令：“河对面是蚕豆国，去消灭他们！”<br />豆豆兵是勇敢的豆豆兵，他们虽然不知道为什么要去打仗，但是，他们愿意听国王的命令。<br />豆豆兵坐上长豇豆火车，出发了。这长豇豆火车里，每一节车厢坐着一个豆豆兵。<br />火车开呀开呀，一条大河挡住了去路。<br />豆豆兵们把火车锯成一节一节，做成小船，每只小船上坐一个豆豆兵。','1','','0','','1','/dpic/20120725/3002.jpg','10945','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRmwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/016.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/016.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/016.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1578','18','0','','','','1','admin','','1','0','1343228292','0','0','0','0','','','1578','0','0','0','0','0','0','救救小乌龟','1343228292','/spic/20120725/2970.jpg','0','1','1343228292','0','3','1','0','','0','','/d/file/swf/034.swf','667','479','一只蛇想吃乌龟的蛋，乌龟没办法打不赢蛇，只能先答应了，乌龟到处找动物们帮忙。找来了小鸟帮忙，小鸟找蜘蛛......最后小乌龟敷出来了，把坏蛇给赶跑了。','1','','0','','1','/dpic/20120725/2971.jpg','10963','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5lbEYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/034.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/034.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/034.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1579','18','0','','','','1','admin','','1','0','1343228293','0','0','0','0','','','1579','0','0','0','0','0','0','和黑猩猩交朋友','1343228293','/spic/20120725/3004.jpg','0','1','1343228293','0','3','1','0','','0','','/d/file/swf/023.swf','667','479','野生黑猩猩生活在非洲的密林里。那里猛兽出没，人迹罕至，因此，长期以来，人们对野生黑猩猩的行为了解很少。在19世纪末和20世纪上半叶，先后有探险家和研究人员前往非洲，试图揭开黑猩猩生活的秘密，但是，由于黑猩猩习性凶猛，不易接近，这些探险家和研究人员未能对黑猩猩进行近距离的细致观察。','1','','0','','1','/dpic/20120725/3005.jpg','10952','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5hazExWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/023.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/023.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/023.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1580','18','0','','','','1','admin','','1','0','1343228293','0','0','0','0','','','1580','0','0','0','0','0','0','懂礼貌的小白兔','1343228293','/spic/20120725/3008.jpg','0','1','1343228293','0','3','1','0','','0','','/d/file/swf/015.swf','667','479','小白兔到山上采蘑菇,他走了好多好多路,采了许多许多蘑菇。等他拎起满满一篮蘑菇,准备回家时,却发现找不到回家的路了。 不远处,山羊妈妈正带着小山羊在吃草。小白兔跑上前去,鞠了一躬,问道:“山羊妈妈,我迷路了,我的家住在东山坡上,您能告诉我怎么走吗?” 山羊妈妈微笑着用手一指:“从右边的小路一直往前走,过一条小河,翻一座山就勤了。这是一条近路。”','1','','0','','1','/dpic/20120725/3009.jpg','10944','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRlYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/015.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/015.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/015.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1581','18','0','','','','1','admin','','1','0','1343228294','0','0','0','0','','','1581','0','0','0','0','0','0','公正的判决','1343228294','/spic/20120725/3012.jpg','0','1','1343228294','0','3','1','0','','0','','/d/file/swf/022.swf','667','479','做人不能太贪心，想要不劳而获那是不可能的，想要得到什么你就必须付出相应的劳动。做为一名公正人员面对什么事情的时候，也要做出相应的事情，给那些想要不劳而获的人重型，让他们知道想要得到你想要的，就必须先要付出。','1','','0','','1','/dpic/20120725/3013.jpg','10951','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5ha2wxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/022.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/022.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/022.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1582','18','0','','','','1','admin','','1','0','1343228294','0','0','0','0','','','1582','0','0','0','0','0','0','九色鹿','1343228294','/spic/20120725/2978.jpg','0','1','1343228294','0','3','1','0','','0','','/d/file/swf/033.swf','667','479','古时候，在一座景色秀丽的山中，有一只鹿，双角洁白如雪，浑身是九种鲜艳的毛色，漂亮极了！人称九色鹿。 <br />这天，九色鹿在河边散步。突然，一个人抱着根木头顺流而下，在汹涌的波浪中奋力挣扎，高呼：“救命啊，救命！”美丽善良的九色鹿不顾自己安危，跳进河中，费尽九牛二虎之力，终于将落水人救上岸来。惊魂未定的落水人名叫调达，得救后频频向九色鹿叩头，感激他说：“谢谢你的救命之恩。我对天起誓，永做你的奴仆，为你寻草觅食，终身受你的驱使……','1','','0','','1','/dpic/20120725/2979.jpg','10962','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5lazExWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/033.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/033.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/033.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1583','18','0','','','','1','admin','','1','0','1343228296','0','0','0','0','','','1583','0','0','0','0','0','0','顶满和嘭嘭','1343228296','/spic/20120725/3014.jpg','0','1','1343228296','0','3','1','0','','0','','/d/file/swf/014.swf','667','479','一只大蟒蛇吞了2只动物，一只叫丁满的野猪，一只叫嘭嘭的老鼠。丁满和嘭嘭在蛇腹里想办法出来，结果想了个计谋，最终脱困而出。','1','','0','','1','/dpic/20120725/3015.jpg','10943','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRkYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/014.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/014.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/014.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1584','18','0','','','','1','admin','','1','0','1343228296','0','0','0','0','','','1584','0','0','0','0','0','0','给鱼儿找个家','1343228296','/spic/20120725/3016.jpg','0','1','1343228296','0','3','1','0','','0','','/d/file/swf/021.swf','667','479','鱼儿在大海里不断的寻找着能当自己家的东西，有找过朔料带、模板、门窗，废旧的小船等等。不停的寻找着一个栖身立命之所.....','1','','0','','1','/dpic/20120725/3018.jpg','10950','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5ha1YxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/021.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/021.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/021.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1585','18','0','','','','1','admin','','1','0','1343228296','0','0','0','0','','','1585','0','0','0','0','0','0','鸡的机智','1343228296','/spic/20120725/2984.jpg','0','1','1343228296','0','3','1','0','','0','','/d/file/swf/032.swf','667','479','一条凶恶的大坏狼抓了一只鸡。鸡说：\\\\\"狼先生，你可不能吃我啊！\\\\\"\\\\\"为什么？\\\\\"狼问道。\\\\\"因为我现在肚子痛得好厉害！\\\\\"\\\\\"你肚子痛跟我有什么关系？\\\\\"\\\\\"我刚才不小心把农药吃进了肚子，中了毒。你要是吃了我，你也会中毒的！\\\\\"\\\\\"啊，是这样吗？那我只好不吃你了！唉，算我今天倒楣！\\\\\"狼说完，便很不甘心地走开了... ','1','','0','','1','/dpic/20120725/2985.jpg','10961','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5la2wxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/032.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/032.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/032.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1586','18','0','','','','1','admin','','1','0','1343228297','0','0','0','0','','','1586','0','0','0','0','0','0','丁丁和小飞机','1343228297','/spic/20120725/3020.jpg','0','1','1343228297','0','3','1','0','','0','','/d/file/swf/013.swf','667','479','丁丁是个聪明的孩子，一心想开飞机。 <br />老师在教生字，丁丁一边听，一边忙着做小飞机。 <br />老师看见了，问：“丁丁你在做什么？”丁丁站起来，低声说：“我在做飞机。” <br />老师说：“上课的时候，好好学习，长大了才能开飞机。” <br />晚上 ，丁丁做了个梦。梦见纸飞机变成了银光闪闪的真飞机。丁丁连忙跑过去。','1','','0','','1','/dpic/20120725/3021.jpg','10942','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRTExWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/013.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/013.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/013.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1587','18','0','','','','1','admin','','1','0','1343228297','0','0','0','0','','','1587','0','0','0','0','0','0','会爱的小狮子','1343228297','/spic/20120725/2990.jpg','0','1','1343228297','0','3','1','0','','0','','/d/file/swf/031.swf','667','479','我读了一本书叫《会爱的小狮子》，我觉得这本书很好，因为有一只小狮它跟动物都是好朋友，我的老师也喜欢这本故事书。','1','','0','','1','/dpic/20120725/2991.jpg','10960','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5la1YxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/031.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/031.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/031.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1588','18','0','','','','1','admin','','1','0','1343228297','0','0','0','0','','','1588','0','0','0','0','0','0','长鼻子熊开汽车','1343228297','/spic/20120725/3042.jpg','0','1','1343228297','0','3','1','0','','0','','/d/file/swf/010.swf','667','479','长鼻子熊在美国买了一辆新车。他没有好好地学习开车，就开着汽车到处乱跑。 <br />长鼻子熊请小羊来坐车。小羊刚坐上去，他就“哧”的一声开跑了。 <br />长鼻子熊把车开得飞快。小羊在车上大声嚷嚷：“你超速了，请开慢点！”长鼻子熊敲敲方向盘说：“没问题！我就喜欢这样开！”','1','','0','','1','/dpic/20120725/3043.jpg','10939','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRUYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/010.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/010.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/010.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1589','18','0','','','','1','admin','','1','0','1343228298','0','0','0','0','','','1589','0','0','0','0','0','0','赤壁之战','1343228298','/spic/20120725/3026.jpg','0','1','1343228298','0','3','1','0','','0','','/d/file/swf/012.swf','667','479','赤壁之战是指三国形成时期，孙权、刘备联军于汉献帝建安十三年（208）在长江赤壁（今湖北赤壁西北）一带大胜曹操军队，奠定三国鼎立基础的著名战役。战争日期在公元208年七月—十二日。是历史上，以少胜多的著名战例之一。','1','','0','','1','/dpic/20120725/3027.jpg','10941','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRWwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/012.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/012.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/012.jpg','0','三个月以上','0','','0','','0','0','0');");
