E_D("replace into `phome_ecms_game` values('1591','18','0','','','','1','admin','','1','0','1343228299','0','0','0','0','','','1591','0','0','0','0','0','0','唱歌的小鸟','1343228299','/spic/20120725/3032.jpg','0','1','1343228299','0','3','1','0','','0','','/d/file/swf/011.swf','667','479','距今一千多年前，德国国内有许多小的王国，每个小王国里都有国王，住在鱼网山上的国王很喜欢打猎。<br />有一天，两个宰相左右相随国王，带着许多猎人出外打猎，被山下放羊的三个女孩看见了。她们姐妹三人都有倾国之色，大女孩指着国王<br />对两个妹妹说：“你们记 着，如果我得不到这个人，我就一生不结婚。”','1','','0','','1','/dpic/20120725/3033.jpg','10940','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WRVYxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/011.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/011.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/011.jpg','0','三个月以上','0','','0','','0','0','0');");
