E_D("replace into `phome_ecms_game` values('1593','18','0','','','','1','admin','','1','0','1343228300','0','0','0','0','','','1593','0','0','0','0','0','0','不好意思','1343228300','/spic/20120725/3058.jpg','0','1','1343228300','0','3','1','0','','0','','/d/file/swf/08.swf','667','479','毛毛虫先生有棵苹果树，它爱它的苹果树，因为苹果树又能给它吃，又能给它住。','1','','0','','1','/dpic/20120725/3059.jpg','10937','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZFBRelY2WkRKWlBRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/08.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/08.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/08.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1594','20','0','','','','1','admin','|30|','1','0','1343228302','0','0','0','0','','','1594','0','0','0','0','0','0','以猪代牛','1343228302','/spic/20120725/3094.jpg','0','1','1343895041','0','3','1','0','','1','','/d/file/swf/2972.swf','667','479','从前，有一个叫商於子的人，他家里很贫穷。<br />春天到了，家家都在争夺农时，抓紧时间开犁耕田播种，盼望秋天获得个好收成。<br />商於子的左邻右舍，有的用牛耕田，有的用马耕田，最次的也用驴耕田。他也很想像邻居那样去耕地，好等到秋天有些收成，也就不用再挨饿了，可是他家没有牛，也没有马、驴这些牲口，唯一的牲口就是家里养的那头肥猪。','1','','0','','1','/dpic/20120725/3095.jpg','10914','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBKTlU1NlNYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/2972.swf','http://www.61baobao.com/common/flash/2010/dpic/2972.jpg','http://www.61baobao.com/common/flash/2010/pic/2972.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1595','20','0','','','','1','admin','','1','0','1343228302','0','0','0','0','','','1595','0','0','0','0','0','0','橄榄树和无花果树','1343228302','/spic/20120725/3070.jpg','0','1','1343228302','0','3','1','0','','0','','/d/file/swf/0290.swf','667','479','冬天，橄榄树讥笑无花果树说： 我一年四季常青，永远漂亮，而你的树叶到冬天就会凋落，仅在夏天美丽。 正当他夸夸其谈时，天突然下起了大雪，雪花飘飘而来。雪花全都压在枝繁叶茂的橄榄树上，一会儿就把他压垮了，美丽也随之消失了。而光秃秃的无花果树，一点也没被雪伤害。','1','','0','','1','/dpic/20120725/3071.jpg','10923','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbXQzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0290.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0290.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0290.jpg','0','三个月以上','0','','0','','0','0','0');");
