E_D("replace into `phome_ecms_game` values('1597','20','0','','','','1','admin','','1','0','1343228304','0','0','0','0','','','1597','0','0','0','0','0','0','羊和狼','1343228304','/spic/20120725/3100.jpg','0','1','1343228304','0','3','1','0','','0','','/d/file/swf/0280.swf','667','479','一只小羊在河边喝水，狼见到后，便想找一个名正言顺的借口吃掉他。于是他跑到上游，恶狠狠地说小羊把河水搅浑浊了，使他喝不到清水。小羊回答说，他仅仅站 在河边喝水，并且又在下游，根本不可能把上游的水搅浑。','1','','0','','1','/dpic/20120725/3101.jpg','10913','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbWQzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0280.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0280.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0280.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1598','20','0','','','','1','admin','','1','0','1343228304','0','0','0','0','','','1598','0','0','0','0','0','0','自我陶醉的梅花鹿','1343228304','/spic/20120725/3076.jpg','0','1','1343228304','0','3','1','0','','0','','/d/file/swf/0289.swf','667','479','炎热的夏天到了，火辣辣的太阳晒得人浑身流汗，嗓子冒烟。一头鹿口渴极了。他跑啊跑啊，来到小河边喝水.他把嘴凑近水边，喝了个痛快。','1','','0','','1','/dpic/20120725/3077.jpg','10922','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbWMxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0289.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0289.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0289.jpg','0','三个月以上','0','','0','','0','0','0');");
