E_D("replace into `phome_ecms_game` values('1604','20','0','','','','1','admin','','1','0','1343228308','0','0','0','0','','','1604','0','0','0','0','0','0','重金买骨','1343228308','/spic/20120725/3050.jpg','0','1','1343228308','0','3','1','0','','0','','/d/file/swf/0287.swf','667','479','从前有个国王想买几匹千里马，他愿意出一千镒金子（一镒等于二十四两）购买千里马。三年过去了，没有一个前来卖千里马的，国王为此闷闷不乐。','1','','0','','1','/dpic/20120725/3052.jpg','10920','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbWN6VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0287.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0287.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0287.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1605','20','0','','','','1','admin','','1','0','1343228309','0','0','0','0','','','1605','0','0','0','0','0','0','仙人整容','1343228309','/spic/20120725/3074.jpg','0','1','1343228309','0','3','1','0','','0','','/d/file/swf/3022.swf','667','479','一位仙人以仁爱之心来到人间，他想给丑陋的人带来快乐，因为他此行就是为别人休整面容而来的，结果树林里的动物都来了.','1','','0','','1','/dpic/20120725/3075.jpg','10910','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjNUSHBOZDAxcVNYVmpNMlJ0','0','0','http://s.61baobao.com/common/flash/2010/3022.swf','http://www.61baobao.com/common/flash/2010/dpic/3022.jpg','http://www.61baobao.com/common/flash/2010/pic/3022.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1606','18','0','','','','1','admin','','1','0','1343228309','0','0','0','0','','','1606','0','0','0','0','0','0','棒棒圣诞节','1343228309','/spic/20120725/3040.jpg','0','1','1343228309','0','3','1','0','','0','','/d/file/swf/04.swf','667','479','一年一度的圣诞节又来到啦~走在街上，到处都是圣诞树，满眼都是圣诞节的感觉。','1','','0','','1','/dpic/20120725/3041.jpg','10933','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE9RelY2WkRKWlBRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/04.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/04.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/04.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1607','20','0','','','','1','admin','','1','0','1343228310','0','0','0','0','','','1607','0','0','0','0','0','0','折竿进城','1343228310','/spic/20120725/3055.jpg','0','1','1343228310','0','3','1','0','','0','','/d/file/swf/0286.swf','667','479','有一个鲁国人扛着一根长长的竹竿进城去卖。当他走到城门口时犯愁了，因为他想不出什么办法将竹竿扛进城去。把竹竿竖起来进城门吧，竹竿比城门高出一截；把竹竿横起来拿着走吧，竹竿比城门又宽一截。他横着、竖着比划了半天，搞的满头大汗，就是进不了城门。','1','','0','','1','/dpic/20120725/3057.jpg','10919','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbWN5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0286.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0286.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0286.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1608','20','0','','','','1','admin','','1','0','1343228310','0','0','0','0','','','1608','0','0','0','0','0','0','无病找病','1343228310','/spic/20120725/3084.jpg','0','1','1343228310','0','3','1','0','','0','','/d/file/swf/054.swf','667','479','从前有位先生姓王,有一天王先生去外乡看朋友,回来的时候得了风寒.','1','','0','','1','/dpic/20120725/3085.jpg','10909','VEhwTmRVMURPSGRPYVRoM1RsUlJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/054.swf','http://www.61baobao.com/3.0/06/dpic/054.jpg','http://www.61baobao.com/3.0/06/pic/054.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1609','18','0','','','','1','admin','','1','0','1343228310','0','0','0','0','','','1609','0','0','0','0','0','0','白杨树和马斑草','1343228310','/spic/20120725/3044.jpg','0','1','1343228310','0','3','1','0','','0','','/d/file/swf/03.swf','667','479','一棵高高的白杨树，笔直地站立在原野上，一副神气活现、不可一世的样子。<br />白杨树周围贴地长着一片柔细的马斑草。它们文静谦恭，默默地为大地编织着美丽的绿茵。<br />这天，白杨树忍不住对它的邻居炫耀道：“喂，马斑草，瞧我的树干有多强壮！我浑身是劲，能够力当千钧，而你们的身体这么细弱，怕是<br /><br />连驱赶一只苍蝇的力气也没有吧？唉，你们实在太可怜了”','1','','0','','1','/dpic/20120725/3045.jpg','10932','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5lVFY2WkRKWlBRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/03.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/03.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/03.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1610','20','0','','','','1','admin','','1','0','1343228311','0','0','0','0','','','1610','0','0','0','0','0','0','糟粕','1343228311','/spic/20120725/3066.jpg','0','1','1343228311','0','3','1','0','','0','','/d/file/swf/0285.swf','667','479','一切外国的东西，如同我们对于食物一样，必须经过自己的口腔咀嚼和胃肠运动，送进唾液胃液肠液，把它分解为精华和糟粕两部分，然后排泄其糟粕，吸收其精华，才能对我们的身体有益，决不能生吞活剥地毫无批判地吸收。','1','','0','','1','/dpic/20120725/3067.jpg','10918','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbWN4VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0285.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0285.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0285.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1611','20','0','','','','1','admin','','1','0','1343228311','0','0','0','0','','','1611','0','0','0','0','0','0','乌鸦和狐狸 1','1343228311','/spic/20120725/3092.jpg','0','1','1343228311','0','3','1','0','','0','','/d/file/swf/wuyaheshui.swf','667','479','一只乌鸦停在一棵树上，嘴里叼着一块奶酪。一只狐狸被奶酪的气味吸引了过来，对乌鸦说道：“哎，尊敬的乌鸦，您好！您是多么漂亮啊！在我看来您真是美极了！真的不骗您，如果您的歌喉和您的羽毛一样美丽，那么，您就是这林中的百鸟之王了。”听了这些话，乌鸦得意忘形，喜不自胜。为了显示它那美丽的歌喉，乌鸦张大了嘴巴，奶酪就掉了下来。狐狸得到了奶酪，并对乌鸦说：“我的好好先生，你要记住：所有阿谀奉承的人都是靠损害爱听吹捧的人的利益过日子的。这一教训也许值一块奶酪吧。”乌鸦满脸惭愧，不知说什么好，发誓以后再也不上当受骗了。可惜，这已有点儿晚了。','1','','0','','1','/dpic/20120725/3093.jpg','10908','VEROd01Fd3pSbkJpYlVwb1luazVNMlJZYkdoaFIxWjZZVWhXY0V4dVRqTmFaejA5','0','0','http://s.61baobao.com/zt/qinbao/wuyaheshui.swf','http://www.61baobao.com/zt/qinbao/dpic/wuyaheshui.jpg','http://www.61baobao.com/zt/qinbao/pic/wuyaheshui.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1612','18','0','','','','1','admin','','1','0','1343228312','0','0','0','0','','','1612','0','0','0','0','0','0','爸爸妈妈吵架','1343228312','/spic/20120725/3048.jpg','0','1','1343228312','0','3','1','0','','0','','/d/file/swf/02.swf','667','479','爸爸妈妈吵架,西瓜好害怕,<br />爸爸妈妈不要吵,<br />我是你们的好宝宝好宝宝.<br />别怕别怕你别怕,<br />爸爸妈妈会合好.<br />爸爸妈妈吵架,西瓜好害怕,<br />爸爸妈妈不要吵,<br />我是你们的好宝宝好宝宝.<br />别怕别怕你别怕,<br />爸爸妈妈会合好.','1','','0','','1','/dpic/20120725/3049.jpg','10931','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5hVFY2WkRKWlBRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/02.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/02.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/02.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1613','20','0','','','','1','admin','','1','0','1343228314','0','0','0','0','','','1613','0','0','0','0','0','0','愚公移山','1343228314','/spic/20120725/3072.jpg','0','1','1343228314','0','3','1','0','','0','','/d/file/swf/0284.swf','667','479','从前啊，有一个老爷爷叫愚公，他的家门前有两座非常高的大山。每次出门的时候都要绕着山走上好长时间，太耽误时间了。愚公老爷爷想：这两座大山太碍事儿了，干脆，我把山挪开吧。”这个愚公老爷爷就是说要把大山挪走，山那么大，怎么能挪得动呢。','1','','0','','1','/dpic/20120725/3073.jpg','10917','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbWN3VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0284.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0284.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0284.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1614','20','0','','','','1','admin','','1','0','1343228314','0','0','0','0','','','1614','0','0','0','0','0','0','驼医治病','1343228314','/spic/20120725/3098.jpg','0','1','1343228314','0','3','1','0','','0','','/d/file/swf/047.swf','667','479','一个自称叫驼医的郎中，说自己的医术与别人不同，能治好驼背，不管驼的像弓、像虾、像锅底都能治好。于是有个驼背的人来治病，医生把他驼背治好了，结果人却治死了......','1','','0','','1','/dpic/20120725/3099.jpg','10907','VEhwTmRVMURPSGRPYVRoM1RrUmpkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/047.swf','http://www.61baobao.com/3.0/06/dpic/047.jpg','http://www.61baobao.com/3.0/06/pic/047.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1615','18','0','','','','1','admin','','1','0','1343228314','0','0','0','0','','','1615','0','0','0','0','0','0','爱美的小公鸡 1','1343228314','/spic/20120725/3054.jpg','0','1','1343228314','0','3','1','0','','0','','/d/file/swf/01.swf','667','479','小公鸡真神气,身穿花衣服,头戴小红帽,喔喔,看我多美丽！ <br />一大早,小公鸡起来,看到小蜜蜂,“小蜜蜂,小蜜蜂,和我比一比,看看谁美丽!”小蜜蜂说：“我要忙着采蜜呢,你没 事还是跟别人去比吧!”','1','','0','','1','/dpic/20120725/3056.jpg','10930','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5VelY2WkRKWlBRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/08/01.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/01.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/01.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1616','20','0','','','','1','admin','','1','0','1343228315','0','0','0','0','','','1616','0','0','0','0','0','0','愚蠢的马','1343228315','/spic/20120725/3080.jpg','0','1','1343228315','0','3','1','0','','0','','/d/file/swf/0283.swf','667','479','驴子请求同行的马替它分载一点背上的东西，但是马不肯帮忙。不久驴子因精疲力竭而死去。主人把驴子背的东西全搬到马的背上。马呻吟地说道：“我竟然做了这么愚蠢的事。当初我要是稍微帮助驴子一下，现在也不会背全部的负担。”','1','','0','','1','/dpic/20120725/3081.jpg','10916','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbWQ2VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0283.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0283.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0283.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1617','20','0','','','','1','admin','','1','0','1343228315','0','0','0','0','','','1617','0','0','0','0','0','0','鸵鸟和鹰','1343228315','/spic/20120725/3104.jpg','0','1','1343228315','0','3','1','0','','0','','/d/file/swf/0273.swf','667','479','鸵鸟抬头看见天上有一只鸟飞得很高很高，直入云端。 <br />鸵鸟问旁边的喜鹊说：“这是谁飞得这么高？”<br />喜鹊回答：“这是老鹰啊！”<br />鸵鸟摇着头说：“绝不会是它，去年我亲眼看见它连起飞也不会，跌跌撞撞的，真把我笑死了。”','1','','0','','1','/dpic/20120725/3105.jpg','10906','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbU42VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0273.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0273.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0273.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1618','20','0','','','','1','admin','','1','0','1343228317','0','0','0','0','','','1618','0','0','0','0','0','0','天鹅、鱼儿和螃蟹','1343228317','/spic/20120725/3118.jpg','0','1','1343228317','0','3','1','0','','0','','/d/file/swf/yonge.swf','667','479','　风和日丽的海滩上，三个小伙伴看见一艘船，小伙伴们想把小船推进海里，于是大家拼命的拉船，可是小船始终没有动，又尝试了几次，小船还是没有动，小伙伴开始相互抱怨，彼此没有用力，最后还打了起来，海豚看见了，连忙阻止了他们，问清了缘由，呵呵笑了起来，告诉他们，因为他们三个一直往不同的方向拉，小船当然不会动了。','1','','0','','1','/dpic/20120725/3119.jpg','10904','VEROd01Fd3pSbkJpYlVwb1luazRlVTFFUlhsTU0yeDJZbTFrYkV4dVRqTmFaejA5','0','0','http://s.61baobao.com/zt/qinbao/2012/yonge.swf','http://www.61baobao.com/zt/qinbao/2012/dpic/yonge.jpg','http://www.61baobao.com/zt/qinbao/2012/pic/yonge.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1619','20','0','','','','1','admin','','1','0','1343228318','0','0','0','0','','','1619','0','0','0','0','0','0','愚蠢的饿狼','1343228318','/spic/20120725/3088.jpg','0','1','1343228318','0','3','1','0','','0','','/d/file/swf/0282.swf','667','479','狼是一种非常贪婪的动物，正因为如此，它时时刻刻处于饥饿的状态，不信，你想想古老传说的故事，有哪一个提到狼不是说饿狼的。','1','','0','','1','/dpic/20120725/3089.jpg','10915','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbWQ1VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0282.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0282.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0282.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1620','20','0','','','','1','admin','','1','0','1343228318','0','0','0','0','','','1620','0','0','0','0','0','0','贪心的山猫','1343228318','/spic/20120725/3124.jpg','0','1','1343228318','0','3','1','0','','0','','/d/file/swf/0270.swf','667','479','一天山猫外出寻食，捉到一只鸡，因为天已黑，而且离家还很远，于是他来到好朋友熊的家，熊让山猫住了下来。半夜里，山猫偷偷把鸡吃了，然后把鸡毛留下。天亮了，山猫起来和熊告别，装模作样的去拿鸡。鸡不见了，山猫就哭喊起来，要熊赔他的鸡。熊想，既然朋友的鸡毛在自己家里，自己就有责任，于是他赔了山猫一只鸡。','1','','0','','1','/dpic/20120725/3125.jpg','10903','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbU4zVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0270.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0270.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0270.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1621','20','0','','','','1','admin','','1','0','1343228318','0','0','0','0','','','1621','0','0','0','0','0','0','兔子和老鹰','1343228318','/spic/20120725/3110.jpg','0','1','1343228318','0','3','1','0','','0','','/d/file/swf/laoyingzhuaxiaoji.swf','667','479','兔子对老鹰说：“你并没有什么真本事，就是会飞罢了。如果在陆地上与我赛跑，说不定谁是谁的手下败将呢。”见老鹰展翅飞走，兔子更神气了，大声嚷道：“你笨得只能做一个巢，而我呢，至少有三个洞窟……”老鹰忽然俯冲而下，兔子吓得赶紧向最近的洞窟逃去，没跑出几步，就被鹰爪抓起飞向了蓝天。','1','','0','','1','/dpic/20120725/3111.jpg','10905','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTBUREo0YUdJemJIQmliV1EyWVVoV2FHVkhiR2hpTW5Cd1RHNU9NMXBuUFQwPQ==','0','0','http://s.61baobao.com/common/flash/2008/laoyingzhuaxiaoji.swf','http://www.61baobao.com/common/flash/2008/dpic/laoyingzhuaxiaoji.jpg','http://www.61baobao.com/common/flash/2008/pic/1633.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1622','20','0','','','','1','admin','','1','0','1343228319','0','0','0','0','','','1622','0','0','0','0','0','0','葡萄树和山羊','1343228319','/spic/20120725/3122.jpg','0','1','1343228319','0','3','1','0','','0','','/d/file/swf/079.swf','667','479','葡萄藤刚刚长出嫩绿的新芽，母山羊就非常粗暴地去吃它的嫩叶。葡萄树对母山羊说：“你太残忍了，为什么要伤害我刚刚长出的新芽？难道地上没有青草了？吃了我的叶子，你仍会被宰了拿去祭祀，那时我将把酿成的酒洒在你身上。”来自童话网:http://www.tonghua5.com','1','','0','','1','/dpic/20120725/3123.jpg','10894','VEhwTmRVMURPSGRPYVRoM1RucHJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/079.swf','http://www.61baobao.com/3.0/06/dpic/079.jpg','http://www.61baobao.com/3.0/06/pic/079.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1623','20','0','','','','1','admin','','1','0','1343228320','0','0','0','0','','','1623','0','0','0','0','0','0','死不知悔的驴子','1343228320','/spic/20120725/3130.jpg','0','1','1343228320','0','3','1','0','','0','','/d/file/swf/037.swf','667','479','自然界里有一条不成文的规矩，这就是互相帮助。这一天驴子可没能做到这一点。驴子本是种善良的动物，但不知这一天中了哪门子邪，犯了错误。','1','','0','','1','/dpic/20120725/3131.jpg','10902','VEhwTmRVMURPSGRPYVRoM1RYcGpkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/037.swf','http://www.61baobao.com/3.0/06/dpic/037.jpg','http://www.61baobao.com/3.0/06/pic/037.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1624','20','0','','','','1','admin','','1','0','1343228320','0','0','0','0','','','1624','0','0','0','0','0','0','驴子与马','1343228320','/spic/20120725/3156.jpg','0','1','1343228320','0','3','1','0','','0','','/d/file/swf/0251.swf','667','479','驴子和马是长安一富裕人家驯养的，后来被主人贩卖到了远离京城的淮河边上的两个磨坊里。磨坊就是以给别人磨面为生的人家，在一间小屋子里，装上一个石碾子，用驴子和马来磨面.虽然两个磨坊相隔很近,驴子和马却很难见面,因为两个磨坊主人都是让它们没日没夜地干活.','1','','0','','1','/dpic/20120725/3157.jpg','10884','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbFY0VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0251.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0251.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0251.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1625','20','0','','','','1','admin','','1','0','1343228320','0','0','0','0','','','1625','0','0','0','0','0','0','仆人看门','1343228320','/spic/20120725/3128.jpg','0','1','1343228320','0','3','1','0','','0','','/d/file/swf/075.swf','667','479','　有一户人家主人要出远门了，临行前再三嘱咐仆人要看好门。有一天，前村打打闹闹十分热闹……','1','','0','','1','/dpic/20120725/3129.jpg','10893','VEhwTmRVMURPSGRPYVRoM1RucFZkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/075.swf','http://www.61baobao.com/3.0/06/dpic/075.jpg','http://www.61baobao.com/3.0/06/pic/075.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1626','20','0','','','','1','admin','','1','0','1343228321','0','0','0','0','','','1626','0','0','0','0','0','0','书生救火','1343228321','/spic/20120725/3078.jpg','0','1','1343228321','0','3','1','0','','0','','/d/file/swf/031.swf','667','479','从前有一个书呆子。有一天，不什么原因家里突然失火了……火苗窜上了房顶，但是家里没有梯子，全 家人都很着急。','1','','0','','1','/dpic/20120725/3079.jpg','10901','VEhwTmRVMURPSGRPYVRoM1RYcEZkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/031.swf','http://www.61baobao.com/3.0/06/dpic/031.jpg','http://www.61baobao.com/3.0/06/pic/031.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1627','20','0','','','','1','admin','','1','0','1343228321','0','0','0','0','','','1627','0','0','0','0','0','0','驴和盐','1343228321','/spic/20120725/3166.jpg','0','1','1343228321','0','3','1','0','','0','','/d/file/swf/014.swf','667','479','从前有一个商人，他养着一头驴。他赶着驴走乡串村，做各种买卖。这个商人有时贩卖布匹、珠子，有时贩卖水果和新鲜蔬菜。实际上只要能赚点钱的东西，他都卖。','1','','0','','1','/dpic/20120725/3167.jpg','10883','VEhwTmRVMURPSGRPZVRoM1RWUlJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/014.swf','http://www.61baobao.com/3.0/07/dpic/014.jpg','http://www.61baobao.com/3.0/07/pic/014.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1628','20','0','','','','1','admin','','1','0','1343228322','0','0','0','0','','','1628','0','0','0','0','0','0','披着羊皮的狼 1','1343228322','/spic/20120725/3134.jpg','0','1','1343228322','0','3','1','0','','0','','/d/file/swf/0259.swf','667','479','在一片人迹罕至的草原，三只狼在夜间偷偷溜进羊群，分别吃掉三只羊，各自披着三块羊皮。第二天，羊群和牧羊人都不知道有三只羊被狼吃掉，还以为这三只披着羊皮的狼就是羊。','1','','0','','1','/dpic/20120725/3135.jpg','10892','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbFUxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0259.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0259.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0259.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1629','20','0','','','','1','admin','','1','0','1343228322','0','0','0','0','','','1629','0','0','0','0','0','0','狮子和射手','1343228322','/spic/20120725/3082.jpg','0','1','1343228322','0','3','1','0','','0','','/d/file/swf/006.swf','667','479','有一个神射手很想验证一下自己的威力究竟有多大，便急匆匆地向着山林进发。人类社会他是不屑于去听取意见的，那里充满了太多虚伪的奉承和吹捧，简直令人生厌。神射手需要的只是一句真话而已，为什么偏偏就这么难？','1','','0','','1','/dpic/20120725/3083.jpg','10900','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5SRmwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/006.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/006.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/006.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1630','20','0','','','','1','admin','','1','0','1343228322','0','0','0','0','','','1630','0','0','0','0','0','0','驴耳朵里的跳蚤','1343228322','/spic/20120725/3172.jpg','0','1','1343228322','0','3','1','0','','0','','/d/file/swf/011.swf','667','479','驴耳朵里的一只跳蚤,虽然从来没离开过驴耳朵，却以为自己什么都知道。有一次，驴来到鱼塘边吃草，它便坐在驴耳朵里东望西瞧。面 对满塘大大小小的鱼儿，鱼耳朵里的跳蚤发表起了自己的高见：“今天，我来谈谈养鱼的问题，这个问题跟喂驴子一样重要，我的讲话可以记录、录音，因为这个是 要记住的.........','1','','0','','1','/dpic/20120725/3173.jpg','10882','VEhwTmRVMURPSGRPZVRoM1RWUkZkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/011.swf','http://www.61baobao.com/3.0/07/dpic/011.jpg','http://www.61baobao.com/3.0/07/pic/011.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1631','20','0','','','','1','admin','','1','0','1343228323','0','0','0','0','','','1631','0','0','0','0','0','0','披着狮皮的驴','1343228323','/spic/20120725/3112.jpg','0','1','1343228323','0','3','1','0','','0','','/d/file/swf/080.swf','667','479','森林里一只狮子死了，有一头灰驴拿到死狮的皮，心想：「只要我披上狮子皮，我就变成了狮子，就可以当森林之王，让所有的动物都敬畏我。」它越想越高兴，不禁手舞足蹈起来。','1','','0','','1','/dpic/20120725/3113.jpg','10891','VEhwTmRVMURPSGRPYVRoM1QwUkJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/080.swf','http://www.61baobao.com/3.0/06/dpic/080.jpg','http://www.61baobao.com/3.0/06/pic/080.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1632','20','0','','','','1','admin','','1','0','1343228323','0','0','0','0','','','1632','0','0','0','0','0','0','狮子和山羊','1343228323','/spic/20120725/3090.jpg','0','1','1343228323','0','3','1','0','','0','','/d/file/swf/006.swf','667','479','从前，有一只老山羊和她的羊群走散了。到了晚上，天渐渐黑下来，老山羊很担心，因为她必须赶快走到村子里。<br />　   当老山羊明白她在天黑以前不能赶到目的地的时候，就决定在附近过夜。她在一座小山脚下看见了一个洞，就走了进去，准备在洞里过夜。忽然，她和住在洞里的一头凶猛的狮子打了个照面。','1','','0','','1','/dpic/20120725/3091.jpg','10899','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5SRmwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/006.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/006.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/006.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1633','20','0','','','','1','admin','','1','0','1343228324','0','0','0','0','','','1633','0','0','0','0','0','0','芦苇与橡树','1343228324','/spic/20120725/3136.jpg','0','1','1343228324','0','3','1','0','','0','','/d/file/swf/007.swf','667','479','很有教育意义的英文小故事 为什么大风过后大树倒了，小小的芦苇却美事呢？','1','','0','','1','/dpic/20120725/3137.jpg','10881','VEhwTmRVMURPSGRPZVRoM1RVUmpkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/007.swf','http://www.61baobao.com/3.0/07/dpic/007.jpg','http://www.61baobao.com/3.0/07/pic/007.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1634','20','0','','','','1','admin','','1','0','1343228324','0','0','0','0','','','1634','0','0','0','0','0','0','南郭先生吹竽','1343228324','/spic/20120725/3120.jpg','0','1','1343228324','0','3','1','0','','0','','/d/file/swf/077.swf','667','479','有一个叫南郭的人，生活贫困潦倒，实在没有办法，决定去投奔齐宣王，可是，他如何才能见到齐宣王呢，他打听到齐宣王是一个喜欢听竽的人，于是假装自己是吹竽能手，要求进宫为齐王吹竽，齐宣王很高兴，于是就让他加入吹竽的行列。随着音乐的起伏摇头晃脑，以示自己的卖力和技术的高超，齐宣王看了非常高兴，经常重重的赏他。','1','','0','','1','/dpic/20120725/3121.jpg','10890','VEhwTmRVMURPSGRPYVRoM1RucGpkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/077.swf','http://www.61baobao.com/3.0/06/dpic/077.jpg','http://www.61baobao.com/3.0/06/pic/077.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1635','20','0','','','','1','admin','','1','0','1343228324','0','0','0','0','','','1635','0','0','0','0','0','0','蛇和蟹','1343228324','/spic/20120725/3096.jpg','0','1','1343228324','0','3','1','0','','0','','/d/file/swf/028.swf','667','479','一只善良真诚的蟹和贪得无厌的蛇同居在一个洞里，一次善良的蟹在外面得到了两个鸡蛋，费了九牛二虎之力搬进了家，可那贪吃的蛇为了自己的生存，谢都不说一声将两个蛋都吃了，吃撑了肚子还责怪、埋怨老实的蟹；还有一次蛇在外遇到了庞大身躯的蟒，可恶的蛇在蟒的尾巴上偷偷的咬了一口后反而告诉蟒说，是蟹咬了蟒的尾巴。','1','','0','','1','/dpic/20120725/3097.jpg','10898','VEhwTmRVMURPSGRPYVRoM1RXcG5kV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/028.swf','http://www.61baobao.com/3.0/06/dpic/028.jpg','http://www.61baobao.com/3.0/06/pic/028.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1636','20','0','','','','1','admin','','1','0','1343228324','0','0','0','0','','','1636','0','0','0','0','0','0','猎人救象','1343228324','/spic/20120725/3140.jpg','0','1','1343228324','0','3','1','0','','0','','/d/file/swf/094.swf','667','479','从前,有一个好猎手,他的箭术非常好,可以说是百谢百中。有一次，猎人又带着弓箭来到了大森林。中午的时候，他躺在一块大石头上睡着了......','1','','0','','1','/dpic/20120725/3141.jpg','10880','VEhwTmRVMURPSGRPYVRoM1QxUlJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/094.swf','http://www.61baobao.com/3.0/06/dpic/094.jpg','http://www.61baobao.com/3.0/06/pic/094.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1637','20','0','','','','1','admin','','1','0','1343228325','0','0','0','0','','','1637','0','0','0','0','0','0','牧羊人和野山羊','1343228325','/spic/20120725/3126.jpg','0','1','1343228325','0','3','1','0','','0','','/d/file/swf/0256.swf','667','479','牧羊人把羊群赶到牧场去放，有几只野山羊混杂在他的羊群里。傍晚，牧羊人将所有的羊都赶进羊圈。第二天，暴风雨大作，不能到牧场去放牧，只好在羊圈里饲养。牧羊人丢给自己的羊一点点饲料，仅能不至于饿死。为了把几只野山羊留下，牧羊人给了它们很多饲料。','1','','0','','1','/dpic/20120725/3127.jpg','10889','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hbFV5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0256.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0256.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0256.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1638','20','0','','','','1','admin','','1','0','1343228325','0','0','0','0','','','1638','0','0','0','0','0','0','三头公牛和狮子','1343228325','/spic/20120725/3102.jpg','0','1','1343228325','0','3','1','0','','0','','/d/file/swf/006.swf','667','479','在辽阔的大草原上，生活着红牛、黑牛、黄牛三兄弟。这天，草原上来了一头狮子。狮子看到了三头牛，想把它们吃掉，就向它们猛冲过去。三头公牛马上头朝外，围成了一个圈子。狮子猛冲过来，结果被红牛用角挑出老远。','1','','0','','1','/dpic/20120725/3103.jpg','10897','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1VE9IZE5SRmwxWXpOa2JRPT0=','0','0','http://s.61baobao.com/common/flash/2011b/05/006.swf','http://www.61baobao.com/common/flash/2011b/05/dpic/006.jpg','http://www.61baobao.com/common/flash/2011b/05/pic/006.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1639','20','0','','','','1','admin','','1','0','1343228326','0','0','0','0','','','1639','0','0','0','0','0','0','老鹰、猫和野猪','1343228326','/spic/20120725/3152.jpg','0','1','1343228326','0','3','1','0','','0','','/d/file/swf/laoyingzhuaxiaoji.swf','667','479','一只老鹰飞到一棵大橡树上筑起了巢。一只猫跑到这棵树的树干上找到一个树洞，在那里生下小猫。一只母野猪带着小猪住在这棵树树根的洞里。猫想独占这块地方，便实行她的诡计。她先爬到老鹰巢边说： 你们真不幸啊！不久将要被毁灭，我们也很危险。你不妨看看，那树下的野猪天天挖土，想把这棵树连根拔掉。树一倒下，他就可以轻而易举地把我们的孩子抓去，喂给他的孩子吃。 吓得老鹰心惊胆颤，惊惶失措。','1','','0','','1','/dpic/20120725/3153.jpg','10879','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRTBUREo0YUdJemJIQmliV1EyWVVoV2FHVkhiR2hpTW5Cd1RHNU9NMXBuUFQwPQ==','0','0','http://s.61baobao.com/common/flash/2008/laoyingzhuaxiaoji.swf','http://www.61baobao.com/common/flash/2008/dpic/laoyingzhuaxiaoji.jpg','http://www.61baobao.com/common/flash/2008/pic/1633.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1640','20','0','','','','1','admin','','1','0','1343228326','0','0','0','0','','','1640','0','0','0','0','0','0','蚂蚁和鸽子','1343228326','/spic/20120725/3132.jpg','0','1','1343228326','0','3','1','0','','0','','/d/file/swf/073.swf','667','479','在一个炎热的夏季里，有一只蚂蚁被风刮落到池塘里，命在旦夕，树上有只鸽子看到这情景。“好可怜噢！去帮他吧！”鸽子赶忙将叶子丢进池塘。','1','','0','','1','/dpic/20120725/3133.jpg','10888','VEhwTmRVMURPSGRPYVRoM1RucE5kV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/073.swf','http://www.61baobao.com/3.0/06/dpic/073.jpg','http://www.61baobao.com/3.0/06/pic/073.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1641','20','0','','','','1','admin','','1','0','1343228326','0','0','0','0','','','1641','0','0','0','0','0','0','若石防虎','1343228326','/spic/20120725/3108.jpg','0','1','1343228326','0','3','1','0','','0','','/d/file/swf/026.swf','667','479','若石隐居在冥山的山北，有老虎经常蹲在他的篱笆外窥视。若石率领他的人昼夜警惕。日出的时候敲响钲，日 落就点起篝火，夜晚就敲铃铛守夜。种荆棘灌木、在山谷筑墙来防守。一年过去了，老虎没有得到任何东西。 一天老虎死了，若石大喜，自以为老虎死了没有对自己形成威胁的动物了。','1','','0','','1','/dpic/20120725/3109.jpg','10896','VEhwTmRVMURPSGRPYVRoM1RXcFpkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/026.swf','http://www.61baobao.com/3.0/06/dpic/026.jpg','http://www.61baobao.com/3.0/06/pic/026.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1642','20','0','','','','1','admin','','1','0','1343228327','0','0','0','0','','','1642','0','0','0','0','0','0','老骆驼和小骆驼','1343228327','/spic/20120725/3158.jpg','0','1','1343228327','0','3','1','0','','0','','/d/file/swf/089.swf','667','479','小骆驼跟着哥哥在群当中走，果然一切平平安安。有了哥哥的照顾，草也吃得好，水也喝得饱，哥哥又常给说说笑笑，生活过得很愉快。','1','','0','','1','/dpic/20120725/3159.jpg','10878','VEhwTmRVMURPSGRPYVRoM1QwUnJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/089.swf','http://www.61baobao.com/3.0/06/dpic/089.jpg','http://www.61baobao.com/3.0/06/pic/089.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1643','20','0','','','','1','admin','','1','0','1343228327','0','0','0','0','','','1643','0','0','0','0','0','0','蚂蚁、乌龟和狐狸','1343228327','/spic/20120725/3138.jpg','0','1','1343228327','0','3','1','0','','0','','/d/file/swf/069.swf','667','479','蚂蚁、乌龟和狐狸去旅行，在路上见到一堆谷子，由于谷子少不好分，于是大家决定把谷子种了，收获再分，结果，狐狸总是找借口不干活，等到收获了，还想独吞谷子，最后，蚂蚁和乌龟用智慧战胜了狡猾的狐狸，获得了全部谷子。','1','','0','','1','/dpic/20120725/3139.jpg','10887','VEhwTmRVMURPSGRPYVRoM1RtcHJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/069.swf','http://www.61baobao.com/3.0/06/dpic/069.jpg','http://www.61baobao.com/3.0/06/pic/069.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1644','20','0','','','','1','admin','','1','0','1343228327','0','0','0','0','','','1644','0','0','0','0','0','0','青蛙和老鼠','1343228327','/spic/20120725/3116.jpg','0','1','1343228327','0','3','1','0','','0','','/d/file/swf/084.swf','667','479','一只老鼠饱食终日，长得肥硕丰满，从来不知道要在什么时候忌口。一次它在水泽地旁嬉戏，一只青蛙蹦过来对它说：“请赏光到我家，我请您吃上一顿大餐。”','1','','0','','1','/dpic/20120725/3117.jpg','10895','VEhwTmRVMURPSGRPYVRoM1QwUlJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/084.swf','http://www.61baobao.com/3.0/06/dpic/084.jpg','http://www.61baobao.com/3.0/06/pic/084.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1645','20','0','','','','1','admin','','1','0','1343228329','0','0','0','0','','','1645','0','0','0','0','0','0','老狼和狐狸','1343228329','/spic/20120725/3168.jpg','0','1','1343228329','0','3','1','0','','0','','/d/file/swf/0186.swf','667','479','老狼和狐狸是死对头。老狼每次见到狐狸，都想把狐狸咬死。可狐狸十分聪明机智，每次都安全逃脱了。','1','','0','','1','/dpic/20120725/3169.jpg','10877','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WR2N5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0186.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0186.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0186.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1646','20','0','','','','1','admin','','1','0','1343228329','0','0','0','0','','','1646','0','0','0','0','0','0','骆驼和羊','1343228329','/spic/20120725/3143.jpg','0','1','1343228329','0','3','1','0','','0','','/d/file/swf/061.swf','667','479','骆驼长得高，羊长得矮。骆驼说：“长得高好。”羊说：“不对，长得矮才好呢。”骆驼说：“我可以做一件事，证明高比矮好。羊说：“我也可以做一件事，证明矮比高好。”','1','','0','','1','/dpic/20120725/3145.jpg','10886','VEhwTmRVMURPSGRPYVRoM1RtcEZkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/06/061.swf','http://www.61baobao.com/3.0/06/dpic/061.jpg','http://www.61baobao.com/3.0/06/pic/061.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1647','20','0','','','','1','admin','','1','0','1343228329','0','0','0','0','','','1647','0','0','0','0','0','0','决不奉承','1343228329','/spic/20120725/3192.jpg','0','1','1343228329','0','3','1','0','','0','','/d/file/swf/046.swf','667','479','从前,有个人虽然很穷,但为人耿直,从不阿谈奉承别人。 有一天,一位富人对他说:“我很富有,你为什么不奉承奉承我呢?” 穷人说:“你很有钱不假,但我一个子儿都得不到,我为什么要奉承你?” “好吧。”富人说,“我拿出十分之二的财产送给你,你会奉承我了吧?”','1','','0','','1','/dpic/20120725/3193.jpg','10874','VEhwTmRVMURPSGRPZVRoM1RrUlpkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/046.swf','http://www.61baobao.com/3.0/07/dpic/046.jpg','http://www.61baobao.com/3.0/07/pic/046.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1648','20','0','','','','1','admin','','1','0','1343228331','0','0','0','0','','','1648','0','0','0','0','0','0','狼和鹭鸶','1343228331','/spic/20120725/3174.jpg','0','1','1343228331','0','3','1','0','','0','','/d/file/swf/0186.swf','667','479','冬天来了，大雪封山，白雪皑皑，几乎没有动物再出来活动了。在大雪地里，有一只十分饥饿的狼，它蹒跚着来到了一棵已经干枯的大树下，忽然它眼睛一亮，心里想：咦？那是什么？是骨头吗?是不是我饿花眼了？狼搓了搓眼睛，真的，是一块骨头。它用头拱了拱骨头，狼吞虎咽地吃了下去，不料卡在喉咙里。狼憋得脸通红，虽然说不出话来，却一直在用嘶哑的声音喊。它东张西望，希望有人来帮助它，可是这大冬天里，那还有动物出来活动呀？','1','','0','','1','/dpic/20120725/3175.jpg','10876','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA5RE9IZE5WR2N5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/08/0186.swf','http://www.61baobao.com/common/flash/2011b/08/dpic/0186.jpg','http://www.61baobao.com/common/flash/2011b/08/pic/0186.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1649','20','0','','','','1','admin','','1','0','1343228331','0','0','0','0','','','1649','0','0','0','0','0','0','精卫填海','1343228331','/spic/20120725/3204.jpg','0','1','1343228331','0','3','1','0','','0','','/d/file/swf/042.swf','667','479','精卫填海是《山海经》记叙的一则故事，说的是中国上古时期一种叫精卫的鸟努力填平大海。根据《山海经》记述这种叫精卫的鸟，原来是炎帝宠爱的女儿，有一天她去东海玩，可是突然风暴袭来，她死了。女娃变成了鸟，名字就叫作“精卫鸟”。','1','','0','','1','/dpic/20120725/3205.jpg','10873','VEhwTmRVMURPSGRPZVRoM1RrUkpkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/042.swf','http://www.61baobao.com/3.0/07/dpic/042.jpg','http://www.61baobao.com/3.0/07/pic/042.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1650','20','0','','','','1','admin','','1','0','1343228331','0','0','0','0','','','1650','0','0','0','0','0','0','骡子The Mule','1343228331','/spic/20120725/3150.jpg','0','1','1343228331','0','3','1','0','','0','','/d/file/swf/019.swf','667','479','骡子是一种动物，有雌雄之分，但是没有生育的能力，它是马和驴交配产下的后代，分为驴骡和马骡。公驴可以和母马交配，生下的叫“马骡”，如果是公马和母驴交配，生下的叫“驴骡”，骡个大，具有驴的负重能力和抵抗能力，有马的灵活性和奔跑能力，是非常好的役畜，但不能生育。驴骡个小，一般不如马骡好，一般没有生育能力。','1','','0','','1','/dpic/20120725/3151.jpg','10885','VEhwTmRVMURPSGRPZVRoM1RWUnJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/019.swf','http://www.61baobao.com/3.0/07/dpic/019.jpg','http://www.61baobao.com/3.0/07/pic/019.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1651','20','0','','','','1','admin','','1','0','1343228332','0','0','0','0','','','1651','0','0','0','0','0','0','孔雀和白鹤','1343228332','/spic/20120725/3186.jpg','0','1','1343228332','0','3','1','0','','0','','/d/file/swf/049.swf','667','479','从前有一只非常漂亮的孔雀，他走路总是大摇大摆，目中无人，因为他总觉得自己是天下最美丽的动物了！他头上那璀璨无比的翎毛，像公主头上戴的皇冠。','1','','0','','1','/dpic/20120725/3187.jpg','10875','VEhwTmRVMURPSGRPZVRoM1RrUnJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/049.swf','http://www.61baobao.com/3.0/07/dpic/049.jpg','http://www.61baobao.com/3.0/07/pic/049.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1652','20','0','','','','1','admin','','1','0','1343228332','0','0','0','0','','','1652','0','0','0','0','0','0','冀昌学箭','1343228332','/spic/20120725/3211.jpg','0','1','1343228332','0','3','1','0','','0','','/d/file/swf/040.swf','667','479','甘蝇是古时候的一位射箭能手。他只要一拉弓射箭，将箭射向野兽，野兽就应声而倒；将箭射向天空飞翔着的飞鸟，飞鸟就会顷刻间从空中坠落下来。只要看到过甘蝇射箭的人，没有哪一个不称赞他是射箭能手，真是箭无虚发，百发百中。甘蝇的学生叫飞卫，他跟着甘蝇学射箭非常刻苦，几年以后，飞卫射箭的本领赶上了他的老师甘蝇，真是名师出高徒。后来，又有一个名叫纪昌的人，来拜飞卫为师，跟着飞卫学射箭。','1','','0','','1','/dpic/20120725/3215.jpg','10872','VEhwTmRVMURPSGRPZVRoM1RrUkJkV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/07/040.swf','http://www.61baobao.com/3.0/07/dpic/040.jpg','http://www.61baobao.com/3.0/07/pic/040.jpg','0','三个月以上','0','','0','','0','0','0');");
