E_D("replace into `phome_ecms_game` values('1656','20','0','','','','1','admin','','1','0','1343228334','0','0','0','0','','','1656','0','0','0','0','0','0','坏心眼的鹧鸪','1343228334','/spic/20120725/3154.gif','0','1','1343228334','0','3','1','0','','0','','/d/file/swf/shizihelu.swf','667','479','一只鹧鸪在树林间蹦蹦跳跳地玩耍，偶尔也会在地上捕食一些小昆虫，鹧鸪高兴地边玩边唱：“鹧鸪鹧鸪真快乐啊，咿呀咿呀约~”正当鹧鸪玩得开心的时候，只听“啪”的一声，捕鸟人的网严严实实地落在了鹧鸪的身上，鹧鸪成为了捕鸟人的猎物。','1','','0','','1','/dpic/20120725/3155.gif','10870','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5PYjJGWWNIQmhSMVp6WkZNMWVtUXlXVDA9','0','0','http://s.61baobao.com/common/flash/2006/shizihelu.swf','http://www.61baobao.com/common/flash/2006/dpic/shizihelu.gif','http://www.61baobao.com/common/flash/2006/pic/802.gif','0','三个月以上','0','','0','','0','0','0');");
