E_D("replace into `phome_ecms_game` values('1661','20','0','','','','1','admin','','1','0','1343228338','0','0','0','0','','','1661','0','0','0','0','0','0','狐狸和鹤','1343228338','/spic/20120725/3170.jpg','0','1','1343228338','0','3','1','0','','0','','/d/file/swf/0235.swf','667','479','狐狸和鹤是朋友，一天狐狸请鹤去吃饭，可到了狐狸家，发现桌子上都是盘子盛的食物，鹤嘴尖，没法吃，结果狡猾的狐狸都吃了，而鹤饿着肚子回家了。过了几天，鹤请狐狸吃饭，狐狸很高兴地去了，可到了鹤家发现桌子上都是瓶子装的食物，狐狸嘴短没法吃，而鹤嘴长，可以伸到瓶子里去，于是鹤都吃了，而狐狸饿着肚子回家了。','1','','0','','1','/dpic/20120725/3171.jpg','10868','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5hazB4VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0235.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0235.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0235.jpg','0','三个月以上','0','','0','','0','0','0');");
