E_D("replace into `phome_ecms_game` values('1664','20','0','','','','1','admin','','1','0','1343228339','0','0','0','0','','','1664','0','0','0','0','0','0','猴子和鹿','1343228339','/spic/20120725/3176.gif','0','1','1343228339','0','3','1','0','','0','','/d/file/swf/yanshuhe.swf','667','479','有一天,猴子碰见梅花鹿.他们俩呀,都说自己的本领大,说着,说着,吵起架来了,最后决定来个比赛. <br />他们看见松鼠在树上吃果子,就请松鼠当裁判员.松鼠说:\\\\\"好哇,你们谁先拿到我这果子,就是谁的本领大.\\\\\"','1','','0','','1','/dpic/20120725/3177.gif','10867','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlURE5zYUdKdVRtOWtWMmhzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/yanshuhe.swf','http://www.61baobao.com/common/flash/2006/dpic/yanshuhe.gif','http://www.61baobao.com/common/flash/2006/pic/803.gif','0','三个月以上','0','','0','','0','0','0');");
