E_D("replace into `phome_ecms_game` values('1667','20','0','','','','1','admin','','1','0','1343228343','0','0','0','0','','','1667','0','0','0','0','0','0','猴子的经验','1343228343','/spic/20120725/3188.gif','0','1','1343228343','0','3','1','0','','0','','/d/file/swf/mahemafu.swf','667','479','猴子在街上买了杯子、碗、茶壶和盘子，一只手拿起杯子一只手拿起碗，地上还有盘子和壶，突然它看到一个过路人用篮子装了很多东西，猴子脑子机灵一转，买来了篮子，装起了所以的东西回家了。','1','','0','','1','/dpic/20120725/3189.gif','10866','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFRXlUREl4YUdGSFZuUlpWMW94VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2006/mahemafu.swf','http://www.61baobao.com/common/flash/2006/dpic/mahemafu.gif','http://www.61baobao.com/common/flash/2006/pic/808.gif','0','三个月以上','0','','0','','0','0','0');");
