E_D("replace into `phome_ecms_game` values('1713','18','0','','','','1','admin','','1','0','1343228364','0','0','0','0','','','1713','0','0','0','0','0','0','雪儿','1343228364','/spic/20120725/3357.jpg','0','1','1343228364','0','3','1','0','','0','','/d/file/swf/0171.swf','667','479','很久以前，在一个荒地里由一个面积很小的森林，没有人知道那儿有个王国，里面住的全是熊。而熊姑娘只有四位。两个母亲，两个女儿。两位姑娘都是王国里的公主。公主中，一个恶毒、丑陋、愚笨，叫雪儿，一个善良、美丽、聪明，叫蝶儿。<br />','1','','0','','1','/dpic/20120725/3358.jpg','10804','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WR040VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0171.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0171.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0171.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1714','18','0','','','','1','admin','','1','0','1343228365','0','0','0','0','','','1714','0','0','0','0','0','0','小幽灵','1343228365','/spic/20120725/3402.jpg','0','1','1343228365','0','3','1','0','','0','','/d/file/swf/0161.swf','667','479','   在欧洲有一座古堡，叫做猫头鹰岩。自古以来，在古堡中就住着一个小幽灵。他是那种心地善良的夜间小幽灵，从来不伤害人，除非人惹恼了他。<br />    白天，他睡在一个笨重的钉上了铁皮的橡木箱子里。箱子就放在古堡的阁楼上，藏在一个粗烟囱后面，没人知道它属于一个小幽灵。','1','','0','','1','/dpic/20120725/3403.jpg','10794','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmw0VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0161.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0161.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0161.jpg','0','三个月以上','0','','0','','0','0','0');");
