E_D("replace into `phome_ecms_game` values('1716','18','0','','','','1','admin','','1','0','1343228365','0','0','0','0','','','1716','0','0','0','0','0','0','学校欢迎会','1343228365','/spic/20120725/3364.jpg','0','1','1343228365','0','3','1','0','','0','','/d/file/swf/0170.swf','667','479','格瑞魔法学校是世界上唯一一间注册魔法学校，创始人奥伯伦满怀雄心壮志地要将霍格沃兹魔法学校和哈利波特的世界变成现实。','1','','0','','1','/dpic/20120725/3365.jpg','10803','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WR04zVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0170.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0170.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0170.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1717','18','0','','','','1','admin','','1','0','1343228366','0','0','0','0','','','1717','0','0','0','0','0','0','小熊维尼的世界','1343228366','/spic/20120725/3410.jpg','0','1','1343228366','0','3','1','0','','0','','/d/file/swf/0160.swf','667','479','首次出现在1925年12月24日漫画刊登于伦敦晚报，身高55厘米，它是一头可爱的小熊，全身毛茸茸的。维尼自己可能会告诉你他是一只“没有头脑的熊”，其实他心明眼亮，头脑清晰。性格天真、单纯、诚实、乐观、助人为乐、体贴、贪吃、好奇 。','1','','0','','1','/dpic/20120725/3411.jpg','10793','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmwzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0160.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0160.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0160.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1718','18','0','','','','1','admin','','1','0','1343228366','0','0','0','0','','','1718','0','0','0','0','0','0','寻找大自然','1343228366','/spic/20120725/3316.jpg','0','1','1343228366','0','3','1','0','','0','','/d/file/swf/0177.swf','667','479','','1','','0','','1','/dpic/20120725/3317.jpg','10810','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WR016VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0177.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0177.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0177.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1719','18','0','','','','1','admin','','1','0','1343228366','0','0','0','0','','','1719','0','0','0','0','0','0','学缺点','1343228366','/spic/20120725/3374.jpg','0','1','1343228366','0','3','1','0','','0','','/d/file/swf/0169.swf','667','479','集中精中做事（激情）。做任何事情都百分之百投入，哪怕只有百分之一的希望，我将付出百分百的努力。做事一定要有激情，这样会使工作效率担高好多倍。玩的时候就不要想到学习，学习的时候就不要想到玩，如果想的话，最终是一个都没有想到。','1','','0','','1','/dpic/20120725/3375.jpg','10802','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmsxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0169.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0169.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0169.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1720','18','0','','','','1','admin','','1','0','1343228366','0','0','0','0','','','1720','0','0','0','0','0','0','小王子','1343228366','/spic/20120725/3419.jpg','0','1','1343228366','0','3','1','0','','0','','/d/file/swf/0159.swf','667','479','作品通过这个小王子的经历，阐述了对社会上不同类型的大人的看法和批评，提出了一些发人深思的问题。作者特别借小王子之口赞颂了情谊和友爱，希望人们要发展友情，相互热爱。在作者看来，爱就要像小王子住的星球上的火山一样炽热，友情就要像小王子那样兢兢业业为玫瑰花刈除恶草。','1','','0','','1','/dpic/20120725/3421.jpg','10792','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlUxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0159.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0159.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0159.jpg','0','三个月以上','0','','0','','0','0','0');");
