E_D("replace into `phome_ecms_game` values('1722','18','0','','','','1','admin','','1','0','1343228367','0','0','0','0','','','1722','0','0','0','0','0','0','熊猫请教师','1343228367','/spic/20120725/3344.jpg','0','1','1343228367','0','3','1','0','','0','','/d/file/swf/0168.swf','667','479','首先熊猫知道积极进取，所以他想请家教，学得更多的知识与本领，但在大熊领他去找狐狸的路上，他看到了大熊偷蛋与偷鱼的行为，则看到了狐狸这位老师的素质与水平，与其什么不懂也不愿意向其学习。最重要的是反映一点老师的行为习惯与作风直接影响学生，所以为人师表很重要，对于教育，老师的素质也很重要！','1','','0','','1','/dpic/20120725/3345.jpg','10801','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmswVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0168.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0168.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0168.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1723','18','0','','','','1','admin','','1','0','1343228368','0','0','0','0','','','1723','0','0','0','0','0','0','小兔子乖乖','1343228368','/spic/20120725/3388.jpg','0','1','1343228368','0','3','1','0','','0','','/d/file/swf/0158.swf','667','479','大森林里，住着快乐的兔子一家，兔妈妈和她的三个孩子——长耳朵、红眼睛还有短尾巴。<br />兔妈妈与三只小兔：（欢快的音乐声中，兔妈妈牵着三只小兔鱼贯而出，围成圈齐念）小白兔、白又白，两只耳朵竖起来，爱吃萝卜爱吃菜，蹦蹦跳跳真可爱。（四处游玩吃草，蹦蹦跳跳回家）','1','','0','','1','/dpic/20120725/3389.jpg','10791','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlUwVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0158.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0158.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0158.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1724','18','0','','','','1','admin','','1','0','1343228368','0','0','0','0','','','1724','0','0','0','0','0','0','幸福','1343228368','/spic/20120725/3350.jpg','0','1','1343228368','0','3','1','0','','0','','/d/file/swf/0167.swf','667','479','幸福是指人之所以为人的真理与自己同在时的心理状态，包括一切真实的事物、人性的道理、他人的生命甚至动物的生命与自己同在等等，是一种心理欲望得到满足时的状态，是一种持续时间较长的对生活的满足和感到生活有巨大乐趣并自然而然地希望持续久远的愉快心情。','1','','0','','1','/dpic/20120725/3351.jpg','10800','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmt6VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0167.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0167.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0167.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1725','18','0','','','','1','admin','','1','0','1343228368','0','0','0','0','','','1725','0','0','0','0','0','0','寻太阳 下集','1343228368','/spic/20120725/3326.jpg','0','1','1343228368','0','3','1','0','','0','','/d/file/swf/0175.swf','667','479','','1','','0','','1','/dpic/20120725/3327.jpg','10808','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WR014VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0175.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0175.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0175.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1726','18','0','','','','1','admin','','1','0','1343228369','0','0','0','0','','','1726','0','0','0','0','0','0','小兔胜狮王','1343228369','/spic/20120725/3396.jpg','0','1','1343228369','0','3','1','0','','0','','/d/file/swf/0157.swf','667','479','童话总是能够为孩子们营造一个美轮美奂的世界。童话故事不仅能满足孩子们的幻想，培养孩子们的文学兴趣，有助于孩子们的启蒙教育。当然，它们的作用还远远不止这些，人类一切美好品德的方方面面，都能从这些童话故事中找到源头。 一段小故事，一个大世界。简单明了的启蒙知识，充满智慧和哲理的童话故事，美妙动听的儿童歌曲，让您的孩子成为自信快乐的智慧宝宝！','1','','0','','1','/dpic/20120725/3397.jpg','10790','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlV6VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0157.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0157.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0157.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1727','18','0','','','','1','admin','','1','0','1343228369','0','0','0','0','','','1727','0','0','0','0','0','0','星猫梦境历险1','1343228369','/spic/20120725/3355.jpg','0','1','1343228369','0','3','1','0','','0','','/d/file/swf/0166.swf','667','479','居住在天神星上的星猫梦见自己正在经历一场奇妙的旅程……','1','','0','','1','/dpic/20120725/3356.jpg','10799','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmt5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0166.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0166.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0166.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1728','18','0','','','','1','admin','','1','0','1343228369','0','0','0','0','','','1728','0','0','0','0','0','0','寻太阳 上集','1343228369','/spic/20120725/3330.jpg','0','1','1343228369','0','3','1','0','','0','','/d/file/swf/0174.swf','667','479','','1','','0','','1','/dpic/20120725/3331.jpg','10807','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WR013VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0174.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0174.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0174.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1729','18','0','','','','1','admin','','1','0','1343228370','0','0','0','0','','','1729','0','0','0','0','0','0','小兔过生日','1343228370','/spic/20120725/3404.jpg','0','1','1343228370','0','3','1','0','','0','','/d/file/swf/0156.swf','667','479','森林里，有一只胖胖的小兔子，他就要过生日了。在生日那天，他的表兄弟姐妹们都要来祝贺，一共有五个呢？这下小兔妈妈可犯愁了,她跟小兔子说：“咱们家没有那么多餐具，怎么来招待五位客人呢？”小兔想了想，眼珠转了转，想出了一个好办法，他一句话没说，就飞快的跑了出去。原来他是向邻居借东西去了。兔子首先跑到熊妈妈家说明了来意，熊妈妈说：“我们可以借你五把椅子。”小兔子高兴的向熊妈妈道了谢。','1','','0','','1','/dpic/20120725/3405.jpg','10789','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlV5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0156.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0156.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0156.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1730','18','0','','','','1','admin','','1','0','1343228370','0','0','0','0','','','1730','0','0','0','0','0','0','笑弥嘞','1343228370','/spic/20120725/3370.jpg','0','1','1343228370','0','3','1','0','','0','','/d/file/swf/0165.swf','667','479','据佛经记载，弥勒出生于古印度波罗奈国的一个婆罗门家庭，与释迦是同时代人。后来随释迦出家，成为佛弟子，他在释迦入灭之前先行去世。据说释迦曾预言，他离开此世间后，将上生兜率天宫，在那儿与诸天演说佛法，直到释迦佛灭度后五十六亿六千万年时，才从兜率天宫下生，来到人间。据《弥勒下生成佛经》所说，到那时，娑婆世界(即我们所生活的有情世间)阎浮提有翅头末城，其王名儴佉的，弥勒届时将托生于此城中一个名叫修梵摩的大臣家中，降生、出家、成道、说法，其经历一如释迦牟尼佛。弥勒继释迦成佛后，将在华林园龙华树下三次说法，广度众生。 ','1','','0','','1','/dpic/20120725/3371.jpg','10798','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmt4VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0165.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0165.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0165.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1731','18','0','','','','1','admin','','1','0','1343228370','0','0','0','0','','','1731','0','0','0','0','0','0','小偷的衣服被偷了','1343228370','/spic/20120725/3412.jpg','0','1','1343228370','0','3','1','0','','0','','/d/file/swf/0155.swf','667','479','一只小偷狐狸跑到2只小杨家里偷东西，看到米缸装满了米，于是就偷小羊的衣服来包米打算偷走......，','1','','0','','1','/dpic/20120725/3413.jpg','10788','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlV4VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0155.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0155.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0155.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1732','18','0','','','','1','admin','','1','0','1343228370','0','0','0','0','','','1732','0','0','0','0','0','0','血战长坂','1343228370','/spic/20120725/3342.jpg','0','1','1343228370','0','3','1','0','','0','','/d/file/swf/0173.swf','667','479','','1','','0','','1','/dpic/20120725/3343.jpg','10806','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WR042VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0173.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0173.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0173.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1733','18','0','','','','1','admin','','1','0','1343228371','0','0','0','0','','','1733','0','0','0','0','0','0','小蜈蚣穿鞋','1343228371','/spic/20120725/3376.jpg','0','1','1343228371','0','3','1','0','','0','','/d/file/swf/088.swf','667','479','明天，是个特别的日子，小蜈蚣呀就要去上学啦。这可是件大事儿。所以呀，今天一大早，小蜈蚣就跟着妈妈到商场买文具去了。他们整整买了一个上午，都买了写什么呢？有铅笔、小刀、橡皮、水彩笔、练习本、文具盒、小皮球…哎呀，买的东西可真多啊，数都数不过来！妈妈的大口袋呀被塞得满满的，可沉了。','1','','0','','1','/dpic/20120725/3377.jpg','10797','VEhwTmRVMURPSGRPVXpoM1QwUm5kV016WkcwPQ==','0','0','http://s.61baobao.com/3.0/05/088.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0164.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0164.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1734','18','0','','','','1','admin','','1','0','1343228371','0','0','0','0','','','1734','0','0','0','0','0','0','小汤姆历险记','1343228371','/spic/20120725/3422.jpg','0','1','1343228371','0','3','1','0','','0','','/d/file/swf/0154.swf','667','479','小汤姆在森林里迷路了，他吃光了干粮以后，实在没有办法就准备打一些猎物来充饥，动物们希望汤姆都能放过它们，它们跟着汤姆作为报答……','1','','0','','1','/dpic/20120725/3423.jpg','10787','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlV3VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0154.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0154.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0154.jpg','0','三个月以上','0','','0','','0','0','0');");
