E_D("replace into `phome_ecms_game` values('1736','18','0','','','','1','admin','','1','0','1343228372','0','0','0','0','','','1736','0','0','0','0','0','0','小鹌鹑妈妈','1343228372','/spic/20120725/3392.jpg','0','1','1343228372','0','3','1','0','','0','','/d/file/swf/0163.swf','667','479','讲述了一位伟大的鹌鹑母亲为了捍卫孩子,在猎狗面前没有一丝退缩。妈妈可以一边看一边跟幼儿讲解。 ','1','','0','','1','/dpic/20120725/3393.jpg','10796','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmw2VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0163.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0163.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0163.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1737','18','0','','','','1','admin','','1','0','1343228372','0','0','0','0','','','1737','0','0','0','0','0','0','小泰莱莎','1343228372','/spic/20120725/3428.jpg','0','1','1343228372','0','3','1','0','','0','','/d/file/swf/0153.swf','667','479','泰莱莎是一位小巧聪明的姑娘，可爱得就像个玩具娃娃，因此，大家都叫她小泰莱莎。她和爸爸、妈妈、奶奶住在山上的一个乡村里，日子过得非常快活。 ','1','','0','','1','/dpic/20120725/3429.jpg','10786','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlY2VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0153.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0153.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0153.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1738','18','0','','','','1','admin','','1','0','1343228372','0','0','0','0','','','1738','0','0','0','0','0','0','小猪盖房子 1','1343228372','/spic/20120725/3398.jpg','0','1','1343228372','0','3','1','0','','0','','/d/file/swf/0162.swf','667','479','《三只小猪》是一个著名的英国童话，讲述了三只小猪在长大后，学好了本领，各自盖了不同的房子，却遭遇大灰狼的故事。这个故事构思简洁，主题鲜明，告诉我们不能追求华而不实的东西，要为长远打算，否则就会有不好的后果。这个故事教育孩子做人要勤劳肯干、聪明机智、乐于助人。','1','','0','','1','/dpic/20120725/3399.jpg','10795','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRmw1VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0162.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0162.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0163.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1739','18','0','','','','1','admin','|30|','1','0','1343228373','0','0','0','0','','','1739','0','0','0','0','0','0','小水精','1343228373','/spic/20120725/3434.jpg','0','1','1343228373','0','3','1','0','','0','','/d/file/swf/0152.swf','667','479','小水精一家住在磨坊池塘的水底下，和所有的男孩一样，他快乐而调皮。小水精一天天地长大，他认识了磨坊池塘里的各种鱼类，骑在鲤鱼齐普里奴斯的背上游来游去。还浮到水面上，第一次了解到了空气、雨、太阳、月亮，还有船、磨坊，最开心的是把磨坊的水糟当滑滑板玩——对了，还有人，他和三个男孩儿交上了朋友，一块儿烤石头吃（其实是土豆）……一年很快过去了，池塘的水面结了厚厚的冰，小水精要冬眠了，他在美丽的梦幻中期待着春天的到来','1','','0','','1','/dpic/20120725/3435.jpg','10785','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlY1VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0152.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0152.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0152.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1740','18','0','','','','1','admin','','1','0','1343228373','0','0','0','0','','','1740','0','0','0','0','0','0','小人和巨人','1343228373','/spic/20120725/3446.jpg','0','1','1343228373','0','3','1','0','','0','','/d/file/swf/0151.swf','667','479','很久很久以前，大地上住着一个名叫安泰的巨人，还住着一群奇怪的小人。巨人和小人是兄弟，他们的母亲就是善良的大地。小人很小，一家人可以在一只皮鞋里睡觉。巨人安泰却高大得像一座山，小人用望远镜才能看见他的头，他只有一只眼睛，生在前额中间，眼珠子有车轮那么大。他吐一口气呀，就像一场风暴，会把成百的小屋顶揭掉，把成千上万的小人吹到空中，团团打转。','1','','0','','1','/dpic/20120725/3447.jpg','10784','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlY0VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0151.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0151.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0151.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1741','18','0','','','','1','admin','','1','0','1343228373','0','0','0','0','','','1741','0','0','0','0','0','0','小猫钓鱼 2','1343228373','/spic/20120725/3436.jpg','0','1','1343228373','0','3','1','0','','0','','/d/file/swf/0141.swf','667','479','一个晴朗的早晨，小猫妙妙和咪咪姐弟俩跟着妈妈去河边钓鱼。妙妙很仔细地看着妈妈的钓鱼动作，然后专心致志地钓鱼，不一会儿便钓了好多鱼。顽皮的咪咪没有耐心，投下钓钩就去玩耍，鱼饵很快就被小鱼吃掉了。这时在一旁看着它钓鱼的青蛙可乐了，它决定与咪咪开个玩笑，它从水底捞了只破草鞋挂在咪咪的鱼钩上。咪咪忽然觉得鱼竿很沉，“一定是大鱼上钩了”，它心里好开心，可是当它用足气力把钩拉上来一看，却气得吹胡子瞪眼。这时，太阳升到头顶上，妈妈带着姐弟俩回家吃饭。在饭桌上妙妙嘲笑咪咪一上午没有钓到一条鱼，咪咪一脸的不高兴。妈妈批评了妙妙，接着耐心地教育咪咪，告诉它钓鱼一定要专心。咪咪听了妈妈的话，想起自己的行为，很是惭愧。下午，它又来到河边。这次它下了大决心，思想再也不开小差，它睁大眼睛一眨不眨地盯着浮标，不一会儿果然钓到一条大鱼.','1','','0','','1','/dpic/20120725/3437.jpg','10774','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRkY0VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0141.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0141.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0141.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1742','18','0','','','','1','admin','','1','0','1343228374','0','0','0','0','','','1742','0','0','0','0','0','0','小人国','1343228374','/spic/20120725/3452.jpg','0','1','1343228374','0','3','1','0','','0','','/d/file/swf/0150.swf','667','479','小说讲述外科医生格列佛的出海航行冒险经历，外科医生格列佛随航程途遇险,死里逃生,漂到利立浦特(小人国),被小人捆住献给国王。格列佛温顺的表现逐渐赢得了国王和人民对他的好感,他也渐渐熟悉了小人国的风俗习惯。在格列佛帮助下打败了同样是小人国的“不来夫斯古”，但是格列佛不愿灭掉不来夫斯古帝国,使皇帝很不高兴。这时,皇后寝宫失火,格列佛情急生智,撒了一泡尿把火扑灭,谁知却让皇后大为恼火。于是,小人国君臣沆瀣一气准备除掉格列佛。格列佛听到风声,赶快逃出利立浦特，后来来到不来夫斯古帝国,最后平安回到英国。','1','','0','','1','/dpic/20120725/3453.jpg','10783','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRlYzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0150.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0150.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0150.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1743','18','0','','','','1','admin','','1','0','1343228374','0','0','0','0','','','1743','0','0','0','0','0','0','小狐狸的鬼主意','1343228374','/spic/20120725/3476.jpg','0','1','1343228374','0','3','1','0','','0','','/d/file/swf/6347.swf','667','479','','1','','0','','1','/dpic/20120725/3477.jpg','10754','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsbDZUa1JqZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/6347.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0131.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0131.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1744','18','0','','','','1','admin','','1','0','1343228374','0','0','0','0','','','1744','0','0','0','0','0','0','小鹿遇难','1343228374','/spic/20120725/3448.jpg','0','1','1343228374','0','3','1','0','','0','','/d/file/swf/0140.swf','667','479','有一个猎人住在江边的村子里，他的家里养着一只狗，这只狗很懂事。每次打猎时猎人都带着它。一次，猎人打猎时看到一只小鹿，猎人觉得小鹿很可爱，就把它带回家里....','1','','0','','1','/dpic/20120725/3449.jpg','10773','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRkYzVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0140.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0140.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0140.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1745','18','0','','','','1','admin','','1','0','1343228374','0','0','0','0','','','1745','0','0','0','0','0','0','小青蛙的烦恼','1343228374','/spic/20120725/3460.jpg','0','1','1343228374','0','3','1','0','','0','','/d/file/swf/0149.swf','667','479','从前，有一座小村庄，小村庄里有一个大池塘，池塘里住着一只小青蛙。小村庄的景色非常好，树木郁郁葱葱，小草满地都是，花儿色彩鲜艳，天上晴空万里，池水清澈见底……<br />池塘里住着许多小动物，有各种鱼儿、蜻蜓等。小青蛙在荷叶上练跳远、鱼儿弟弟在荷叶的根之间捉迷藏、蜻蜓姐姐在清澈的湖面上照镜子、小鸟妹妹在放声歌唱……池塘里的动物们就这样无忧无虑地生活着。','1','','0','','1','/dpic/20120725/3461.jpg','10782','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRkUxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0149.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0149.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0149.jpg','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1746','18','0','','','','1','admin','','1','0','1343228375','0','0','0','0','','','1746','0','0','0','0','0','0','小鹿笑了','1343228375','/spic/20120725/3454.jpg','0','1','1343228375','0','3','1','0','','0','','/d/file/swf/0139.swf','667','479','这一天,小鹿到小河边去喝水，忽然发现水面上漂浮着一棵树。原来，这并不是什么树，而是一条露出半个身子的的鳄鱼。鳄鱼缩着身子，一动也不动，好象就是一棵树。它要用这个伪装欺骗小鹿，它会成功吗？.........','1','','0','','1','/dpic/20120725/3455.jpg','10772','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRTAxVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0139.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0139.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0139.jpg','0','三个月以上','0','','0','','0','0','0');");
