E_D("replace into `phome_ecms_game` values('1748','18','0','','','','1','admin','','1','0','1343228375','0','0','0','0','','','1748','0','0','0','0','0','0','小青蛙出门','1343228375','/spic/20120725/3386.jpg','0','1','1343228375','0','3','1','0','','0','','/d/file/swf/0148.swf','667','479','有一只小青蛙非常可爱，但他有个坏习惯，总是粗心大意，爱掉东西。青蛙妈妈为此很伤脑筋。有一天，小青蛙要出门去，青蛙妈妈给他拿了把荷叶伞，一个小水壶，背包里还有一本小人书，叮嘱他要保管好自己的东西。如果他回家时东西没有少，妈妈会奖励他他最爱吃的小馅饼。“放心吧，妈妈。”小青蛙说，“我一定把东西保管好！” ','1','','0','','1','/dpic/20120725/3387.jpg','10781','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRkUwVEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0148.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0148.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0148.jpg','0','三个月以上','0','','0','','0','0','0');");
