E_D("replace into `phome_ecms_game` values('1753','18','0','','','','1','admin','','1','0','1343228377','0','0','0','0','','','1753','0','0','0','0','0','0','小老鼠斯图亚特','1343228377','/spic/20120725/3432.gif','0','1','1343228377','0','3','1','0','','0','','/d/file/swf/6623.swf','667','479','','1','','0','','1','/dpic/20120725/3433.gif','10760','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET1d0TWVsa3lUV3BOZFdNelpHMD0=','0','0','http://s.61baobao.com/common/flash/d/6623.swf','http://www.61baobao.com/common/flash/d/dpic/6623.gif','http://www.61baobao.com/common/flash/d/pic/6623.gif','0','三个月以上','0','','0','','0','0','0');");
E_D("replace into `phome_ecms_game` values('1754','18','0','','','','1','admin','','1','0','1343228377','0','0','0','0','','','1754','0','0','0','0','0','0','小鸟和树','1343228377','/spic/20120725/3400.jpg','0','1','1343228377','0','3','1','0','','0','','/d/file/swf/0146.swf','667','479','在一个阳光明媚的早晨，有一只小鸟从遥远的北方飞来，停在一棵树上。这棵树大概有三十多岁了。小鸟在树上建好了窝，每天在树上唱着美妙的歌。不久，小鸟和树成为了好朋友。每天早晨小鸟起来找食物，走时用歌声向树问好，树也用他的枝干向小鸟招手并问好。就这样，半年一瞬间就过去了。夏天到了，小鸟也要去遥远北方了。走时，它跟大树说：“树，我要走了，其实我也舍不得离开你，这没办法，再见了树，我们冬天见。”小鸟唱着它经常对大树唱的歌，恋恋不舍的飞走了。','1','','0','','1','/dpic/20120725/3401.jpg','10779','VERKT2RtSlhNWFppYVRsdFlrZEdlbUZET0hsTlJFVjRXV2s0ZDA1NU9IZE5WRkV5VEc1T00xcG5QVDA9','0','0','http://s.61baobao.com/common/flash/2011b/07/0146.swf','http://www.61baobao.com/common/flash/2011b/07/dpic/0146.jpg','http://www.61baobao.com/common/flash/2011b/07/pic/0146.jpg','0','三个月以上','0','','0','','0','0','0');");
